(0, '1509', '0', '', '', 'Decayed & Mouldy Silicone & Trims Around Large Corner Bath Tub', '1', '', '120', 'The silicone seal & Trims around the bath are showing signs of decay and back mould growth.', 'The silicone seal & Trims around the bath are showing signs of decay and back mould growth.\r\nYou would like the silicone & trims to be replaced with fresh, neat, ice white silicone that will ensure the bath is 100% neat and 100% watertight. ', 'Install Brand New UPVC trims and Silicone around The Corner Bath Tub', '	We cut out the old silicone & trims around the bath using low impact, none abrasive techniques and tools to avoid damage to any surfaces. A special chemical sealant remover is then applied to all surfaces to remove any microscopic silicone or adhesive residue which could affect the adhesion of the new trims and silicone.\r\n\r\n	Brand new, high gloss UPVC trims are installed and held in place with ultra strong adhesives to ensure a double layer of protection for the seal. \r\n\r\n	We replace the silicone with high quality ForeverWhite silicone which contains microban to prevent future mould growth. All new silicone is applied with a water repelling chamfer which encourages water to drain from the seal and avoid any mould re-growth.\r\n', '4', '', '', '22485'),
(0, '1555', '0', '', '', 'Poor Silicone Detailing Around UPVC Window Frame', '1', '', '175', 'The silicone detailing around the windowsill is showing signs of black mould growth. This is caused by condensation and moisture settling on the seal.', 'The silicone detailing around the windowsill is showing signs of black mould growth. This is caused by condensation and moisture settling on the seal.\r\nWe can replace the existing silicone with an ultra neat, profiled, strip of ice white silicone that will really finish off the window area. \r\n', ' Perform Silicone Replacement to Window Frame and Sill Area', '	We cut out the old silicone around the window area using low impact, none abrasive techniques and tools to avoid damage to any surfaces. \r\n\r\n	A special chemical sealant remover is then applied to all surfaces to remove any microscopic silicone or adhesive residue which could affect the adhesion of the new trims and silicone. \r\n\r\n	We replace the silicone with high quality ForeverWhite silicone which contains microban to prevent future mould growth. All new silicone is applied with a water repelling chamfer which encourages water to drain from the seal and avoid any mould re-growth.\r\n', '4', '', '', '22485'),
(0, '1473', '0', '', '', 'Glass Shower Screen, Shower Head, and Shower Waste All Showing Signs of Lime Scale & Mildew Build up ', '1', '', '145', 'Your shower head, riser rail, hose and shower door are all showing signs of lime scale build up which has dulled their shine. These items can be treated to a sanitizing chemical restoration that will remove all traces of dirt, lime scale and restore their shine. ', 'Your shower head, riser rail, hose and shower door are all showing signs of lime scale build up which has dulled their shine. These items can be treated to a sanitizing chemical restoration that will remove all traces of dirt, lime scale and restore their shine. ', 'Perform Lime Scale Treatment to Glass Shower Screen & Shower Accessories ', '	The shower head, hose, riser rail & Glass undergo a special Viakal chemical treatment which loosens any mould, limescale and mildew. \r\n\r\n	Using rubber scrapers, fine scalpels and blades: we pick, scrape, scrub, and de-scale, every crevice to remove all stubborn traces of mould and lime Scale that have resisted the chemical treatment.\r\n\r\n	Finally we sanitise, buff and polish all metal work to really bring back the shine and leave them fully restored.\r\n', '4', '', '', '22485'),
