(0, '1493', '0', '', '', 'Bath Screen Does Not Provide Adequate Protection ', '1', '', '160', 'The current 4 fold bath screen is 800mm long which is not providing adequate protection for the floor and surrounding areas during use of the shower.', 'The current 4 fold bath screen is 800mm long which is not providing adequate protection for the floor and surrounding areas during use of the shower.', 'Supply and Fit Longer Replacement Folding Shower Screen', '	We source a suitable white framed folding shower screen from our range of trade suppliers. \r\n\r\n	The old screen would be carefully removed to avoid any damage to the tiles and the new one fitted in its place using additional fixings if required. \r\n\r\n	This shower screen is made by Coram and is 1060mm long which provides approximately 260mm more coverage than your current screen.\r\n', '4', '', '', '22485'),
(0, '1495', '0', '', '', 'Green Spots on Wall Tiles', '1', '', '165', 'Some of the wall tiles around the bath have small green specs on them that are left over from previous work on the bathroom.', 'Some of the wall tiles around the bath have small green specs on them that are left over from previous work on the bathroom.\r\nYou would like all the mysterious spots removing and the tiles restored to pristine condition.\r\n', 'Perform Restoration & Polish to Wall Tiles', '	Individual spots on the tiles will be targeted with non-abrasive picks and scrapers to remove all traces of discolouration.\r\n\r\n	A special gloss tile polish is applied to all wall tile surfaces and they are buffed to bring back a deep shine.\r\n', '4', '', '', '22485'),
