(0, '1537', '0', '', '', 'Small Bath Screen & Bath Panel Are Loose ', '1', '', '110', 'The small but effective bath screen and the bath panel itself are both loose. This leaves the areas vulnerable to water penetration.', 'The small but effective bath screen and the bath panel itself are both loose. This leaves the areas vulnerable to water penetration.', 'Re-Fix & Re-Seal Small Bath Screen & Corner Quadrant Bath Panel', '	The bath screen & corner quadrant bath panel are carefully removed and treated to remove any remaining silicone or adhesive residue.\r\n\r\n	The restored screen and panel are fixed firmly into place using industrial strength adhesive and additional clips and bracket where appropriate to ensure a rock solid finish.\r\n\r\n	The screen and panel are then resealed using high quality ForeverWhite silicone which contains microban to prevent future mould growth. All new silicone is applied with a water repelling chamfer which encourages water to drain from the seal and avoid any mould re-growth.\r\n', '4', '', '', '22485'),
