(0, '1039', '2689', '', '', 'Discoloured Silicone Around UPVC Window', '1', '', '200', 'The silicone around the UPVC window is showing signs of discolouration and decay. \r\n\r\nYou would love the whole window area to be restored to fresh, Ice white condition.\r\n', '<p>\r\n  <strong><u>Perform UPVC Window Restoration Including Silicone Replacement </u></strong>\r\n</p><ul>\r\n<li>\r\n  Using special solvents and compounds, the UPVC window frame, glass and surrounding area is restored back to a bright white glossy finish.&nbsp;\r\n</li>\r\n</ul>\r\n<p>\r\n  &nbsp;\r\n</p><ul>\r\n<li>\r\n  The handle and mechanism would then be picked scraped and scrubbed with scalpels and fine blades to remove any surface corrosion.\r\n</li>\r\n</ul>\r\n<p>\r\n  &nbsp;\r\n</p>\r\n<p>\r\n</p><ul>\r\n<li>\r\n  Black rubber gaskets round the window would be treated with non-corrosive chemicals to remove any remaining mould or mildew.\r\n</li>\r\n</ul>\r\n<p>\r\n  &nbsp;\r\n</p><ul>\r\n<li>\r\n  The window frame would then be brought back to ice white condition using a chemical UPVC restorer applied with ultra fine cloths that do not scratch the surface.\r\n</li>\r\n</ul>\r\n<p>\r\n  &nbsp;\r\n</p><ul>\r\n<li>\r\n  Finally, all silicone around the window frame area would be replaced with brand new, fresh, ice white silicone to leave the area fully restored.\r\n</li>\r\n</ul>', 'tophtmlllll', 'bottomhtmllll', '4', '', '', '22485'),
(0, '1503', '0', '', '', 'Decayed & Mouldy Silicone & Trims Around Large Corner Bath Tub', '1', '', '120', 'The silicone seal & Trims around the bath are showing signs of decay and back mould growth.', 'The silicone seal & Trims around the bath are showing signs of decay and back mould growth.\r\nYou would like the silicone & trims to be replaced with fresh, neat, ice white silicone that will ensure the bath is 100% neat and 100% watertight. ', 'Install Brand New UPVC trims and Silicone around The Corner Bath Tub', '	We cut out the old silicone & trims around the bath using low impact, none abrasive techniques and tools to avoid damage to any surfaces. A special chemical sealant remover is then applied to all surfaces to remove any microscopic silicone or adhesive residue which could affect the adhesion of the new trims and silicone.\r\n\r\n	Brand new, high gloss UPVC trims are installed and held in place with ultra strong adhesives to ensure a double layer of protection for the seal. \r\n\r\n	We replace the silicone with high quality ForeverWhite silicone which contains microban to prevent future mould growth. All new silicone is applied with a water repelling chamfer which encourages water to drain from the seal and avoid any mould re-growth.\r\n', '4', '', '', '22485'),
(0, '1047', '2679', '', '', 'testname 2', '1', '', '22', 'test Line on Quote 2', '22222', 'test<span style="color: rgb(63, 63, 63); font-family: Arial, sans-serif; line-height: 13px; text-align: right; background-color: rgb(251, 251, 251); ">Description of Problem</span> 22222222222', 'test\r\n<span style="color: rgb(63, 63, 63); font-family: Arial, sans-serif; line-height: 13px; text-align: right; background-color: rgb(251, 251, 251); ">Description of Solution</span>\r\n\r\n2222', '4', '', '', '22485'),
(0, '1465', '2683', '', '', 'Loose Wall Tiles in Shower Cubicle', '1', '', '125', 'It appears that water has penetrated beneath the wall tiles in the shower cubicle. At least 2 wall tiles at the base of the wall are showing evidence of movement which indicates that the plaster below has been affected.  ', 'It appears that water has penetrated beneath the wall tiles in the shower cubicle. At least 2 wall tiles at the base of the wall are showing evidence of movement which indicates that the plaster below has been affected.  \r\n\r\nThe perfect solution would be to remove the affected tiles, replace the damaged plaster beneath and replace the tiles leaving the area rock solid. \r\n', 'Remove Loose Wall Tiles & Perform Plasterboard Repair to Shower Cubicle', '	Using our specialist grout removal tools we remove any loose tiles and any old adhesive and grout to prepare the tiles for re-fitting later on.\r\n\r\n	Any damp and decayed plaster is removed and new Plasterboard is cut to size and fixed in place of the old, damaged plaster using high quality plasterboard adhesive.  \r\n\r\n	The tiles are re-fixed to the wall with high quality, fast drying adhesive to allow the fix without slowing down the rest of your bathroom restoration.\r\n\r\n	High quality, BAL Forever White Grout is applied to create a 100% watertight seal. \r\n', '4', '', '', '22485'),
(0, '1437', '0', '', '', 'Bath Screen Does Not Provide Adequate Protection ', '1', '', '160', 'The current 4 fold bath screen is 800mm long which is not providing adequate protection for the floor and surrounding areas during use of the shower.', 'The current 4 fold bath screen is 800mm long which is not providing adequate protection for the floor and surrounding areas during use of the shower.', 'Supply and Fit Longer Replacement Folding Shower Screen', '	We source a suitable white framed folding shower screen from our range of trade suppliers. \r\n\r\n	The old screen would be carefully removed to avoid any damage to the tiles and the new one fitted in its place using additional fixings if required. \r\n\r\n	This shower screen is made by Coram and is 1060mm long which provides approximately 260mm more coverage than your current screen.\r\n', '4', '', '', '22485'),
(0, '1559', '0', '', '', 'Poor Silicone Detailing Around UPVC Window Frame', '1', '', '175', 'The silicone detailing around the windowsill is showing signs of black mould growth. This is caused by condensation and moisture settling on the seal.', 'The silicone detailing around the windowsill is showing signs of black mould growth. This is caused by condensation and moisture settling on the seal.\r\nWe can replace the existing silicone with an ultra neat, profiled, strip of ice white silicone that will really finish off the window area. \r\n', ' Perform Silicone Replacement to Window Frame and Sill Area', '	We cut out the old silicone around the window area using low impact, none abrasive techniques and tools to avoid damage to any surfaces. \r\n\r\n	A special chemical sealant remover is then applied to all surfaces to remove any microscopic silicone or adhesive residue which could affect the adhesion of the new trims and silicone. \r\n\r\n	We replace the silicone with high quality ForeverWhite silicone which contains microban to prevent future mould growth. All new silicone is applied with a water repelling chamfer which encourages water to drain from the seal and avoid any mould re-growth.\r\n', '4', '', '', '22485'),
