(0, '1499', '0', '', '', 'Black Mould Growth to Upper Wall Tiles & Ceiling ', '1', '', '75', 'There is evidence of black mould growth to the upper wall tiles and ceiling. This is caused by excess condensation and lack of air flow to the area when the shower is in use.', 'There is evidence of black mould growth to the upper wall tiles and ceiling. This is caused by excess condensation and lack of air flow to the area when the shower is in use.\r\nYou would like a solution that removes all black mould from the tiles and leaves them looking pristine.  \r\n', 'Perform Anti-Mould Chemical Treatment to Upper Wall Tiles & Ceiling', '	The tiles & ceiling is treated with a special anti-mould chemical wash that is designed to break down the majority of the mould deposits.\r\n\r\n	Neat chemical solution and rubber scrapers are then used to treat any particularly stubborn areas of mould and mildew to remove all visible traces. \r\n\r\n	Finally the tiles & ceiling is washed with water, dried and buffed to leave a mould free surface.\r\n', '4', '', '', '22485'),
(0, '1419', '2703', '', '', 'Small Bath Screen & Bath Panel Are Loose ', '1', '', '110', 'The small but effective bath screen and the bath panel itself are both loose. This leaves the areas vulnerable to water penetration.', 'The small but effective bath screen and the bath panel itself are both loose. This leaves the areas vulnerable to water penetration.', 'Re-Fix & Re-Seal Small Bath Screen & Corner Quadrant Bath Panel', '	The bath screen & corner quadrant bath panel are carefully removed and treated to remove any remaining silicone or adhesive residue.\r\n\r\n	The restored screen and panel are fixed firmly into place using industrial strength adhesive and additional clips and bracket where appropriate to ensure a rock solid finish.\r\n\r\n	The screen and panel are then resealed using high quality ForeverWhite silicone which contains microban to prevent future mould growth. All new silicone is applied with a water repelling chamfer which encourages water to drain from the seal and avoid any mould re-growth.\r\n', '4', '', '', '22485'),
