(0, '1551', '2683', '', '', 'Decayed & Mouldy Silicone to Rear of Hand Basin ', '1', '', '90', 'The silicone to the rear of the hand basin is showing signs of black mould growth. ', 'The silicone to the rear of the hand basin is showing signs of black mould growth. \r\nYou would like the silicone to be replaced with fresh, neat, ice white silicone that will ensure the basin is 100% watertight. ', 'Perform Silicone Seal Replacement To Rear of Hand Basin', '	We Replace the silicone seal to the rear of the hand basin using the same techniques as described for around the bath.', '4', '', '', '22485'),
(0, '1445', '2671', '', '', 'Bath Screen is Leaking Between Frame and Wall Tiles', '1', '', '140', 'The bath screen is leaking between the metal frame and the wall tiles. This has caused some damage to the wooden cupboards next to the bath.', 'The bath screen is leaking between the metal frame and the wall tiles. This has caused some damage to the wooden cupboards next to the bath.\r\nYou would love us to cure the leak for good with the application of fresh silicone and grout where appropriate.\r\n', 'Perform Repair to Leaking Bath Screen', '	Any old grout or silicone around the affected area would be removed being especially careful not to damage the bath surface or screen. If appropriate the screen may be removed to allow for better access.\r\n\r\n	Using a combination of trims, grout and silicone where appropriate, we will close any gaps in the screen to restore the 100% watertight seal.\r\n', '4', '', '', '22485'),
(0, '1343', '2695', '', '', 'Mouldy Silicone Around Shower Tray', '1', '', '300', 'Mouldy Silicone Around Shower Tray. \r\n\r\nYou would love the whole window area to be restored to fresh, Ice white condition.', '<p>\n  <strong><u>Perform UPVC Window Restoration Including Silicone Replacement </u></strong>\n</p><ul>\n<li>\n  Using special solvents and compounds, the UPVC window frame, glass and surrounding area is restored back to a bright white glossy finish.&nbsp;\n</li>\n</ul>\n<p>\n  &nbsp;\n</p><ul>\n<li>\n  The handle and mechanism would then be picked scraped and scrubbed with scalpels and fine blades to remove any surface corrosion.\n</li>\n</ul>\n<p>\n  &nbsp;\n</p>\n<p>\n</p><ul>\n<li>\n  Black rubber gaskets round the window would be treated with non-corrosive chemicals to remove any remaining mould or mildew.\n</li>\n</ul>\n<p>\n  &nbsp;\n</p><ul>\n<li>\n  The window frame would then be brought back to ice white condition using a chemical UPVC restorer applied with ultra fine cloths that do not scratch the surface.\n</li>\n</ul>\n<p>\n  &nbsp;\n</p><ul>\n<li>\n  Finally, all silicone around the window frame area would be replaced with brand new, fresh, ice white silicone to leave the area fully restored.\n</li>\n</ul>', 'tophtmlllll', 'bottomhtmllll', '4', '', '', '22485'),
(0, '1485', '0', '', '', 'Glass Shower Screen, Shower Head, and Shower Waste All Showing Signs of Lime Scale & Mildew Build up ', '1', '', '145', 'Your shower head, riser rail, hose and shower door are all showing signs of lime scale build up which has dulled their shine. These items can be treated to a sanitizing chemical restoration that will remove all traces of dirt, lime scale and restore their shine. ', 'Your shower head, riser rail, hose and shower door are all showing signs of lime scale build up which has dulled their shine. These items can be treated to a sanitizing chemical restoration that will remove all traces of dirt, lime scale and restore their shine. ', 'Perform Lime Scale Treatment to Glass Shower Screen & Shower Accessories ', '	The shower head, hose, riser rail & Glass undergo a special Viakal chemical treatment which loosens any mould, limescale and mildew. \r\n\r\n	Using rubber scrapers, fine scalpels and blades: we pick, scrape, scrub, and de-scale, every crevice to remove all stubborn traces of mould and lime Scale that have resisted the chemical treatment.\r\n\r\n	Finally we sanitise, buff and polish all metal work to really bring back the shine and leave them fully restored.\r\n', '4', '', '', '22485'),
(0, '1487', '0', '', '', 'Bath Screen is Leaking Between Frame and Wall Tiles', '1', '', '140', 'The bath screen is leaking between the metal frame and the wall tiles. This has caused some damage to the wooden cupboards next to the bath.', 'The bath screen is leaking between the metal frame and the wall tiles. This has caused some damage to the wooden cupboards next to the bath.\r\nYou would love us to cure the leak for good with the application of fresh silicone and grout where appropriate.\r\n', 'Perform Repair to Leaking Bath Screen', '	Any old grout or silicone around the affected area would be removed being especially careful not to damage the bath surface or screen. If appropriate the screen may be removed to allow for better access.\r\n\r\n	Using a combination of trims, grout and silicone where appropriate, we will close any gaps in the screen to restore the 100% watertight seal.\r\n', '4', '', '', '22485'),
(0, '1469', '0', '', '', 'Small Bath Screen & Bath Panel Are Loose ', '1', '', '110', 'The small but effective bath screen and the bath panel itself are both loose. This leaves the areas vulnerable to water penetration.', 'The small but effective bath screen and the bath panel itself are both loose. This leaves the areas vulnerable to water penetration.', 'Re-Fix & Re-Seal Small Bath Screen & Corner Quadrant Bath Panel', '	The bath screen & corner quadrant bath panel are carefully removed and treated to remove any remaining silicone or adhesive residue.\r\n\r\n	The restored screen and panel are fixed firmly into place using industrial strength adhesive and additional clips and bracket where appropriate to ensure a rock solid finish.\r\n\r\n	The screen and panel are then resealed using high quality ForeverWhite silicone which contains microban to prevent future mould growth. All new silicone is applied with a water repelling chamfer which encourages water to drain from the seal and avoid any mould re-growth.\r\n', '4', '', '', '22485'),
(0, '1239', '2667', '', '', 'Testing product thurs07-06 14.54', '1', '', '0', '', '', '', '', '4', '', '', '22485'),
(0, '1785', '0', '', '', 'Loose Wall Tiles in Shower Cubicle', '1', '', '125', 'It appears that water has penetrated beneath the wall tiles in the shower cubicle. At least 2 wall tiles at the base of the wall are showing evidence of movement which indicates that the plaster below has been affected.  ', 'It appears that water has penetrated beneath the wall tiles in the shower cubicle. At least 2 wall tiles at the base of the wall are showing evidence of movement which indicates that the plaster below has been affected.  \r\n\r\nThe perfect solution would be to remove the affected tiles, replace the damaged plaster beneath and replace the tiles leaving the area rock solid. \r\n', 'Remove Loose Wall Tiles & Perform Plasterboard Repair to Shower Cubicle', '	Using our specialist grout removal tools we remove any loose tiles and any old adhesive and grout to prepare the tiles for re-fitting later on.\r\n\r\n	Any damp and decayed plaster is removed and new Plasterboard is cut to size and fixed in place of the old, damaged plaster using high quality plasterboard adhesive.  \r\n\r\n	The tiles are re-fixed to the wall with high quality, fast drying adhesive to allow the fix without slowing down the rest of your bathroom restoration.\r\n\r\n	High quality, BAL Forever White Grout is applied to create a 100% watertight seal. \r\n', '4', '', '', '22485'),
(0, '1359', '2679', '', '', 'Discoloured Silicone Around UPVC Window', '1', '', '200', 'The silicone around the UPVC window is showing signs of discolouration and decay. \r\n\r\nYou would love the whole window area to be restored to fresh, Ice white condition.\r\n', '<p>\r\n  <strong><u>Perform UPVC Window Restoration Including Silicone Replacement </u></strong>\r\n</p><ul>\r\n<li>\r\n  Using special solvents and compounds, the UPVC window frame, glass and surrounding area is restored back to a bright white glossy finish.&nbsp;\r\n</li>\r\n</ul>\r\n<p>\r\n  &nbsp;\r\n</p><ul>\r\n<li>\r\n  The handle and mechanism would then be picked scraped and scrubbed with scalpels and fine blades to remove any surface corrosion.\r\n</li>\r\n</ul>\r\n<p>\r\n  &nbsp;\r\n</p>\r\n<p>\r\n</p><ul>\r\n<li>\r\n  Black rubber gaskets round the window would be treated with non-corrosive chemicals to remove any remaining mould or mildew.\r\n</li>\r\n</ul>\r\n<p>\r\n  &nbsp;\r\n</p><ul>\r\n<li>\r\n  The window frame would then be brought back to ice white condition using a chemical UPVC restorer applied with ultra fine cloths that do not scratch the surface.\r\n</li>\r\n</ul>\r\n<p>\r\n  &nbsp;\r\n</p><ul>\r\n<li>\r\n  Finally, all silicone around the window frame area would be replaced with brand new, fresh, ice white silicone to leave the area fully restored.\r\n</li>\r\n</ul>', 'tophtmlllll', 'bottomhtmllll', '4', '', '', '22485'),
(0, '1521', '0', '', '', 'Bath Screen Does Not Provide Adequate Protection ', '1', '', '160', 'The current 4 fold bath screen is 800mm long which is not providing adequate protection for the floor and surrounding areas during use of the shower.', 'The current 4 fold bath screen is 800mm long which is not providing adequate protection for the floor and surrounding areas during use of the shower.', 'Supply and Fit Longer Replacement Folding Shower Screen', '	We source a suitable white framed folding shower screen from our range of trade suppliers. \r\n\r\n	The old screen would be carefully removed to avoid any damage to the tiles and the new one fitted in its place using additional fixings if required. \r\n\r\n	This shower screen is made by Coram and is 1060mm long which provides approximately 260mm more coverage than your current screen.\r\n', '4', '', '', '22485'),
(0, '1533', '2685', '', '', 'Bath Screen is Leaking Between Frame and Wall Tiles', '1', '', '140', 'The bath screen is leaking between the metal frame and the wall tiles. This has caused some damage to the wooden cupboards next to the bath.', 'The bath screen is leaking between the metal frame and the wall tiles. This has caused some damage to the wooden cupboards next to the bath.\r\nYou would love us to cure the leak for good with the application of fresh silicone and grout where appropriate.\r\n', 'Perform Repair to Leaking Bath Screen', '	Any old grout or silicone around the affected area would be removed being especially careful not to damage the bath surface or screen. If appropriate the screen may be removed to allow for better access.\r\n\r\n	Using a combination of trims, grout and silicone where appropriate, we will close any gaps in the screen to restore the 100% watertight seal.\r\n', '4', '', '', '22485'),
(0, '1535', '2683', '', '', 'Black Mould Growth to Upper Wall Tiles & Ceiling ', '1', '', '75', 'There is evidence of black mould growth to the upper wall tiles and ceiling. This is caused by excess condensation and lack of air flow to the area when the shower is in use.', 'There is evidence of black mould growth to the upper wall tiles and ceiling. This is caused by excess condensation and lack of air flow to the area when the shower is in use.\r\nYou would like a solution that removes all black mould from the tiles and leaves them looking pristine.  \r\n', 'Perform Anti-Mould Chemical Treatment to Upper Wall Tiles & Ceiling', '	The tiles & ceiling is treated with a special anti-mould chemical wash that is designed to break down the majority of the mould deposits.\r\n\r\n	Neat chemical solution and rubber scrapers are then used to treat any particularly stubborn areas of mould and mildew to remove all visible traces. \r\n\r\n	Finally the tiles & ceiling is washed with water, dried and buffed to leave a mould free surface.\r\n', '4', '', '', '22485'),
