(0, '1621', '0', '', '', 'Glass Shower Screen, Shower Head, and Shower Waste All Showing Signs of Lime Scale & Mildew Build up ', '1', '', '145', 'Your shower head, riser rail, hose and shower door are all showing signs of lime scale build up which has dulled their shine. These items can be treated to a sanitizing chemical restoration that will remove all traces of dirt, lime scale and restore their shine. ', 'Your shower head, riser rail, hose and shower door are all showing signs of lime scale build up which has dulled their shine. These items can be treated to a sanitizing chemical restoration that will remove all traces of dirt, lime scale and restore their shine. ', 'Perform Lime Scale Treatment to Glass Shower Screen & Shower Accessories ', '	The shower head, hose, riser rail & Glass undergo a special Viakal chemical treatment which loosens any mould, limescale and mildew. \r\n\r\n	Using rubber scrapers, fine scalpels and blades: we pick, scrape, scrub, and de-scale, every crevice to remove all stubborn traces of mould and lime Scale that have resisted the chemical treatment.\r\n\r\n	Finally we sanitise, buff and polish all metal work to really bring back the shine and leave them fully restored.\r\n', '4', '', '', '22485'),
