(0, '1631', '2685', '', '', 'Poor Silicone Detailing Around UPVC Window Frame', '1', '', '175', 'The silicone detailing around the windowsill is showing signs of black mould growth. This is caused by condensation and moisture settling on the seal.', 'The silicone detailing around the windowsill is showing signs of black mould growth. This is caused by condensation and moisture settling on the seal.\r\nWe can replace the existing silicone with an ultra neat, profiled, strip of ice white silicone that will really finish off the window area. \r\n', ' Perform Silicone Replacement to Window Frame and Sill Area', '	We cut out the old silicone around the window area using low impact, none abrasive techniques and tools to avoid damage to any surfaces. \r\n\r\n	A special chemical sealant remover is then applied to all surfaces to remove any microscopic silicone or adhesive residue which could affect the adhesion of the new trims and silicone. \r\n\r\n	We replace the silicone with high quality ForeverWhite silicone which contains microban to prevent future mould growth. All new silicone is applied with a water repelling chamfer which encourages water to drain from the seal and avoid any mould re-growth.\r\n', '4', '', '', '22485'),
(0, '1633', '0', '', '', 'Small Bath Screen & Bath Panel Are Loose ', '1', '', '110', 'The small but effective bath screen and the bath panel itself are both loose. This leaves the areas vulnerable to water penetration.', 'The small but effective bath screen and the bath panel itself are both loose. This leaves the areas vulnerable to water penetration.', 'Re-Fix & Re-Seal Small Bath Screen & Corner Quadrant Bath Panel', '	The bath screen & corner quadrant bath panel are carefully removed and treated to remove any remaining silicone or adhesive residue.\r\n\r\n	The restored screen and panel are fixed firmly into place using industrial strength adhesive and additional clips and bracket where appropriate to ensure a rock solid finish.\r\n\r\n	The screen and panel are then resealed using high quality ForeverWhite silicone which contains microban to prevent future mould growth. All new silicone is applied with a water repelling chamfer which encourages water to drain from the seal and avoid any mould re-growth.\r\n', '4', '', '', '22485'),
