(0, '1679', '0', '', '', 'Loose Wall Tiles in Shower Cubicle', '1', '', '125', 'It appears that water has penetrated beneath the wall tiles in the shower cubicle. At least 2 wall tiles at the base of the wall are showing evidence of movement which indicates that the plaster below has been affected.  ', 'It appears that water has penetrated beneath the wall tiles in the shower cubicle. At least 2 wall tiles at the base of the wall are showing evidence of movement which indicates that the plaster below has been affected.  \r\n\r\nThe perfect solution would be to remove the affected tiles, replace the damaged plaster beneath and replace the tiles leaving the area rock solid. \r\n', 'Remove Loose Wall Tiles & Perform Plasterboard Repair to Shower Cubicle', '	Using our specialist grout removal tools we remove any loose tiles and any old adhesive and grout to prepare the tiles for re-fitting later on.\r\n\r\n	Any damp and decayed plaster is removed and new Plasterboard is cut to size and fixed in place of the old, damaged plaster using high quality plasterboard adhesive.  \r\n\r\n	The tiles are re-fixed to the wall with high quality, fast drying adhesive to allow the fix without slowing down the rest of your bathroom restoration.\r\n\r\n	High quality, BAL Forever White Grout is applied to create a 100% watertight seal. \r\n', '4', '', '', '22485'),
(0, '1681', '0', '', '', 'Bath Screen Does Not Provide Adequate Protection ', '1', '', '160', 'The current 4 fold bath screen is 800mm long which is not providing adequate protection for the floor and surrounding areas during use of the shower.', 'The current 4 fold bath screen is 800mm long which is not providing adequate protection for the floor and surrounding areas during use of the shower.', 'Supply and Fit Longer Replacement Folding Shower Screen', '	We source a suitable white framed folding shower screen from our range of trade suppliers. \r\n\r\n	The old screen would be carefully removed to avoid any damage to the tiles and the new one fitted in its place using additional fixings if required. \r\n\r\n	This shower screen is made by Coram and is 1060mm long which provides approximately 260mm more coverage than your current screen.\r\n', '4', '', '', '22485'),
(0, '1683', '0', '', '', 'Decayed & Mouldy Silicone & Trims Around Large Corner Bath Tub', '1', '', '120', 'The silicone seal & Trims around the bath are showing signs of decay and back mould growth.', 'The silicone seal & Trims around the bath are showing signs of decay and back mould growth.\r\nYou would like the silicone & trims to be replaced with fresh, neat, ice white silicone that will ensure the bath is 100% neat and 100% watertight. ', 'Install Brand New UPVC trims and Silicone around The Corner Bath Tub', '	We cut out the old silicone & trims around the bath using low impact, none abrasive techniques and tools to avoid damage to any surfaces. A special chemical sealant remover is then applied to all surfaces to remove any microscopic silicone or adhesive residue which could affect the adhesion of the new trims and silicone.\r\n\r\n	Brand new, high gloss UPVC trims are installed and held in place with ultra strong adhesives to ensure a double layer of protection for the seal. \r\n\r\n	We replace the silicone with high quality ForeverWhite silicone which contains microban to prevent future mould growth. All new silicone is applied with a water repelling chamfer which encourages water to drain from the seal and avoid any mould re-growth.\r\n', '4', '', '', '22485'),
(0, '1685', '0', '', '', 'Bath Screen is Leaking Between Frame and Wall Tiles', '1', '', '140', 'The bath screen is leaking between the metal frame and the wall tiles. This has caused some damage to the wooden cupboards next to the bath.', 'The bath screen is leaking between the metal frame and the wall tiles. This has caused some damage to the wooden cupboards next to the bath.\r\nYou would love us to cure the leak for good with the application of fresh silicone and grout where appropriate.\r\n', 'Perform Repair to Leaking Bath Screen', '	Any old grout or silicone around the affected area would be removed being especially careful not to damage the bath surface or screen. If appropriate the screen may be removed to allow for better access.\r\n\r\n	Using a combination of trims, grout and silicone where appropriate, we will close any gaps in the screen to restore the 100% watertight seal.\r\n', '4', '', '', '22485'),
(0, '1687', '0', '', '', 'Loose Wall Tiles in Shower Cubicle', '1', '', '125', 'It appears that water has penetrated beneath the wall tiles in the shower cubicle. At least 2 wall tiles at the base of the wall are showing evidence of movement which indicates that the plaster below has been affected.  ', 'It appears that water has penetrated beneath the wall tiles in the shower cubicle. At least 2 wall tiles at the base of the wall are showing evidence of movement which indicates that the plaster below has been affected.  \r\n\r\nThe perfect solution would be to remove the affected tiles, replace the damaged plaster beneath and replace the tiles leaving the area rock solid. \r\n', 'Remove Loose Wall Tiles & Perform Plasterboard Repair to Shower Cubicle', '	Using our specialist grout removal tools we remove any loose tiles and any old adhesive and grout to prepare the tiles for re-fitting later on.\r\n\r\n	Any damp and decayed plaster is removed and new Plasterboard is cut to size and fixed in place of the old, damaged plaster using high quality plasterboard adhesive.  \r\n\r\n	The tiles are re-fixed to the wall with high quality, fast drying adhesive to allow the fix without slowing down the rest of your bathroom restoration.\r\n\r\n	High quality, BAL Forever White Grout is applied to create a 100% watertight seal. \r\n', '4', '', '', '22485'),
