(0, '1693', '0', '', '', 'Decayed & Mouldy Silicone to Rear of Hand Basin ', '1', '', '90', 'The silicone to the rear of the hand basin is showing signs of black mould growth. ', 'The silicone to the rear of the hand basin is showing signs of black mould growth. \r\nYou would like the silicone to be replaced with fresh, neat, ice white silicone that will ensure the basin is 100% watertight. ', 'Perform Silicone Seal Replacement To Rear of Hand Basin', '	We Replace the silicone seal to the rear of the hand basin using the same techniques as described for around the bath.', '4', '', '', '22485'),
