(0, '1743', '0', '', '', 'Loose Wall Tiles in Shower Cubicle', '1', '', '125', 'It appears that water has penetrated beneath the wall tiles in the shower cubicle. At least 2 wall tiles at the base of the wall are showing evidence of movement which indicates that the plaster below has been affected.  ', 'It appears that water has penetrated beneath the wall tiles in the shower cubicle. At least 2 wall tiles at the base of the wall are showing evidence of movement which indicates that the plaster below has been affected.  \r\n\r\nThe perfect solution would be to remove the affected tiles, replace the damaged plaster beneath and replace the tiles leaving the area rock solid. \r\n', 'Remove Loose Wall Tiles & Perform Plasterboard Repair to Shower Cubicle', '	Using our specialist grout removal tools we remove any loose tiles and any old adhesive and grout to prepare the tiles for re-fitting later on.\r\n\r\n	Any damp and decayed plaster is removed and new Plasterboard is cut to size and fixed in place of the old, damaged plaster using high quality plasterboard adhesive.  \r\n\r\n	The tiles are re-fixed to the wall with high quality, fast drying adhesive to allow the fix without slowing down the rest of your bathroom restoration.\r\n\r\n	High quality, BAL Forever White Grout is applied to create a 100% watertight seal. \r\n', '4', '', '', '22485'),
(0, '1745', '0', '', '', 'Bath Screen Does Not Provide Adequate Protection ', '1', '', '160', 'The current 4 fold bath screen is 800mm long which is not providing adequate protection for the floor and surrounding areas during use of the shower.', 'The current 4 fold bath screen is 800mm long which is not providing adequate protection for the floor and surrounding areas during use of the shower.', 'Supply and Fit Longer Replacement Folding Shower Screen', '	We source a suitable white framed folding shower screen from our range of trade suppliers. \r\n\r\n	The old screen would be carefully removed to avoid any damage to the tiles and the new one fitted in its place using additional fixings if required. \r\n\r\n	This shower screen is made by Coram and is 1060mm long which provides approximately 260mm more coverage than your current screen.\r\n', '4', '', '', '22485'),
(0, '1747', '2671', '', '', 'Glass Shower Screen, Shower Head, and Shower Waste All Showing Signs of Lime Scale & Mildew Build up ', '1', '', '145', 'Your shower head, riser rail, hose and shower door are all showing signs of lime scale build up which has dulled their shine. These items can be treated to a sanitizing chemical restoration that will remove all traces of dirt, lime scale and restore their shine. ', 'Your shower head, riser rail, hose and shower door are all showing signs of lime scale build up which has dulled their shine. These items can be treated to a sanitizing chemical restoration that will remove all traces of dirt, lime scale and restore their shine. ', 'Perform Lime Scale Treatment to Glass Shower Screen & Shower Accessories ', '	The shower head, hose, riser rail & Glass undergo a special Viakal chemical treatment which loosens any mould, limescale and mildew. \r\n\r\n	Using rubber scrapers, fine scalpels and blades: we pick, scrape, scrub, and de-scale, every crevice to remove all stubborn traces of mould and lime Scale that have resisted the chemical treatment.\r\n\r\n	Finally we sanitise, buff and polish all metal work to really bring back the shine and leave them fully restored.\r\n', '4', '', '', '22485'),
(0, '1749', '0', '', '', 'Glass Shower Screen, Shower Head, and Shower Waste All Showing Signs of Lime Scale & Mildew Build up ', '1', '', '145', 'Your shower head, riser rail, hose and shower door are all showing signs of lime scale build up which has dulled their shine. These items can be treated to a sanitizing chemical restoration that will remove all traces of dirt, lime scale and restore their shine. ', 'Your shower head, riser rail, hose and shower door are all showing signs of lime scale build up which has dulled their shine. These items can be treated to a sanitizing chemical restoration that will remove all traces of dirt, lime scale and restore their shine. ', 'Perform Lime Scale Treatment to Glass Shower Screen & Shower Accessories ', '	The shower head, hose, riser rail & Glass undergo a special Viakal chemical treatment which loosens any mould, limescale and mildew. \r\n\r\n	Using rubber scrapers, fine scalpels and blades: we pick, scrape, scrub, and de-scale, every crevice to remove all stubborn traces of mould and lime Scale that have resisted the chemical treatment.\r\n\r\n	Finally we sanitise, buff and polish all metal work to really bring back the shine and leave them fully restored.\r\n', '4', '', '', '22485'),
(0, '1751', '2685', '', '', 'Green Spots on Wall Tiles', '1', '', '165', 'Some of the wall tiles around the bath have small green specs on them that are left over from previous work on the bathroom.', 'Some of the wall tiles around the bath have small green specs on them that are left over from previous work on the bathroom.\r\nYou would like all the mysterious spots removing and the tiles restored to pristine condition.\r\n', 'Perform Restoration & Polish to Wall Tiles', '	Individual spots on the tiles will be targeted with non-abrasive picks and scrapers to remove all traces of discolouration.\r\n\r\n	A special gloss tile polish is applied to all wall tile surfaces and they are buffed to bring back a deep shine.\r\n', '4', '', '', '22485'),
(0, '1753', '2701', '', '', 'Mouldy Silicone Around Shower Tray', '1', '', '170', 'Mouldy Silicone Around Shower Tray. You would love the whole window area to be restored to fresh, Ice white condition.', 'Perform UPVC Window Restoration Including Silicone Replacement Using special solvents and compounds, the UPVC window frame, glass and surrounding area is restored back to a bright white glossy finish.The handle and mechanism would then be picked scraped and scrubbed with scalpels and fine blades to remove any surface corrosion.Black rubber gaskets round the window would be treated with non-corrosive chemicals to remove any remaining mould or mildew.The window frame would then be brought back to ice white condition using a chemical UPVC restorer applied with ultra fine cloths that do not scratch the surface.Finally, all silicone around the window frame area would be replaced with brand new, fresh, ice white silicone to leave the area fully restored.', 'Perform Silicone Seal Replacement Around Shower Tray & Vertical Wall Tile Joints', '	We cut out the old silicone around the shower tray using low impact, none abrasive techniques and tools to avoid damage to any surfaces. \r\n\r\n	A special chemical sealant remover is then applied to all surfaces to remove any microscopic silicone or adhesive residue which could affect the adhesion of the new trims and silicone. \r\n\r\n	We replace the silicone with high quality ForeverWhite silicone which contains microban to prevent future mould growth. All new silicone is applied with a water repelling chamfer which encourages water to drain from the seal and avoid any mould re-growth.\r\n', '4', 'Core', 'https://lh4.googleusercontent.com/-xnbkO4krFEc/T_RcNAlTtqI/AAAAAAAAEx0/iS2o9u2niFQ/s800/IMG_7442.JPG', '22485'),
(0, '1755', '2671', '', '', 'Black Mould Growth to Upper Wall Tiles & Ceiling ', '1', '', '75', 'There is evidence of black mould growth to the upper wall tiles and ceiling. This is caused by excess condensation and lack of air flow to the area when the shower is in use.', 'There is evidence of black mould growth to the upper wall tiles and ceiling. This is caused by excess condensation and lack of air flow to the area when the shower is in use.\r\nYou would like a solution that removes all black mould from the tiles and leaves them looking pristine.  \r\n', 'Perform Anti-Mould Chemical Treatment to Upper Wall Tiles & Ceiling', '	The tiles & ceiling is treated with a special anti-mould chemical wash that is designed to break down the majority of the mould deposits.\r\n\r\n	Neat chemical solution and rubber scrapers are then used to treat any particularly stubborn areas of mould and mildew to remove all visible traces. \r\n\r\n	Finally the tiles & ceiling is washed with water, dried and buffed to leave a mould free surface.\r\n', '4', '', '', '22485'),
(0, '1757', '0', '', '', 'Bath Screen Does Not Provide Adequate Protection ', '1', '', '160', 'The current 4 fold bath screen is 800mm long which is not providing adequate protection for the floor and surrounding areas during use of the shower.', 'The current 4 fold bath screen is 800mm long which is not providing adequate protection for the floor and surrounding areas during use of the shower.', 'Supply and Fit Longer Replacement Folding Shower Screen', '	We source a suitable white framed folding shower screen from our range of trade suppliers. \r\n\r\n	The old screen would be carefully removed to avoid any damage to the tiles and the new one fitted in its place using additional fixings if required. \r\n\r\n	This shower screen is made by Coram and is 1060mm long which provides approximately 260mm more coverage than your current screen.\r\n', '4', '', '', '22485'),
(0, '1759', '0', '', '', 'Decayed & Mouldy Silicone & Trims Around Large Corner Bath Tub', '1', '', '120', 'The silicone seal & Trims around the bath are showing signs of decay and back mould growth.', 'The silicone seal & Trims around the bath are showing signs of decay and back mould growth.\r\nYou would like the silicone & trims to be replaced with fresh, neat, ice white silicone that will ensure the bath is 100% neat and 100% watertight. ', 'Install Brand New UPVC trims and Silicone around The Corner Bath Tub', '	We cut out the old silicone & trims around the bath using low impact, none abrasive techniques and tools to avoid damage to any surfaces. A special chemical sealant remover is then applied to all surfaces to remove any microscopic silicone or adhesive residue which could affect the adhesion of the new trims and silicone.\r\n\r\n	Brand new, high gloss UPVC trims are installed and held in place with ultra strong adhesives to ensure a double layer of protection for the seal. \r\n\r\n	We replace the silicone with high quality ForeverWhite silicone which contains microban to prevent future mould growth. All new silicone is applied with a water repelling chamfer which encourages water to drain from the seal and avoid any mould re-growth.\r\n', '4', '', '', '22485'),
