INSERT INTO `orderitem` (`tableID`, `Id`, `OrderId`, `ProductId`, `SubscriptionPlanId`, `ItemName`, `Qty`, `CPU`, `PPU`, `ItemDescription`, `ItemDescription2`, `ItemDescription3`, `ItemDescription4`, `ItemType`, `Notes`, `picasaURL`, `_dID`) VALUES
(0, '1829', '2691', '', '', 'Loose Wall Tiles in Shower Cubicle', '1', '', '125', 'It appears that water has penetrated beneath the wall tiles in the shower cubicle. At least 2 wall tiles at the base of the wall are showing evidence of movement which indicates that the plaster below has been affected.  ', 'It appears that water has penetrated beneath the wall tiles in the shower cubicle. At least 2 wall tiles at the base of the wall are showing evidence of movement which indicates that the plaster below has been affected.  \r\n\r\nThe perfect solution would be to remove the affected tiles, replace the damaged plaster beneath and replace the tiles leaving the area rock solid. \r\n', 'Remove Loose Wall Tiles & Perform Plasterboard Repair to Shower Cubicle', '	Using our specialist grout removal tools we remove any loose tiles and any old adhesive and grout to prepare the tiles for re-fitting later on.\r\n\r\n	Any damp and decayed plaster is removed and new Plasterboard is cut to size and fixed in place of the old, damaged plaster using high quality plasterboard adhesive.  \r\n\r\n	The tiles are re-fixed to the wall with high quality, fast drying adhesive to allow the fix without slowing down the rest of your bathroom restoration.\r\n\r\n	High quality, BAL Forever White Grout is applied to create a 100% watertight seal. \r\n', '4', '', '', '22485'),
(0, '1831', '0', '', '', 'Glass Shower Screen, Shower Head, and Shower Waste All Showing Signs of Lime Scale & Mildew Build up ', '1', '', '145', 'Your shower head, riser rail, hose and shower door are all showing signs of lime scale build up which has dulled their shine. These items can be treated to a sanitizing chemical restoration that will remove all traces of dirt, lime scale and restore their shine. ', 'Your shower head, riser rail, hose and shower door are all showing signs of lime scale build up which has dulled their shine. These items can be treated to a sanitizing chemical restoration that will remove all traces of dirt, lime scale and restore their shine. ', 'Perform Lime Scale Treatment to Glass Shower Screen & Shower Accessories ', '	The shower head, hose, riser rail & Glass undergo a special Viakal chemical treatment which loosens any mould, limescale and mildew. \r\n\r\n	Using rubber scrapers, fine scalpels and blades: we pick, scrape, scrub, and de-scale, every crevice to remove all stubborn traces of mould and lime Scale that have resisted the chemical treatment.\r\n\r\n	Finally we sanitise, buff and polish all metal work to really bring back the shine and leave them fully restored.\r\n', '4', '', '', '22485'),
(0, '1833', '0', '', '', 'Loose Wall Tiles in Shower Cubicle', '1', '', '125', 'It appears that water has penetrated beneath the wall tiles in the shower cubicle. At least 2 wall tiles at the base of the wall are showing evidence of movement which indicates that the plaster below has been affected.  ', 'It appears that water has penetrated beneath the wall tiles in the shower cubicle. At least 2 wall tiles at the base of the wall are showing evidence of movement which indicates that the plaster below has been affected.  \r\n\r\nThe perfect solution would be to remove the affected tiles, replace the damaged plaster beneath and replace the tiles leaving the area rock solid. \r\n', 'Remove Loose Wall Tiles & Perform Plasterboard Repair to Shower Cubicle', '	Using our specialist grout removal tools we remove any loose tiles and any old adhesive and grout to prepare the tiles for re-fitting later on.\r\n\r\n	Any damp and decayed plaster is removed and new Plasterboard is cut to size and fixed in place of the old, damaged plaster using high quality plasterboard adhesive.  \r\n\r\n	The tiles are re-fixed to the wall with high quality, fast drying adhesive to allow the fix without slowing down the rest of your bathroom restoration.\r\n\r\n	High quality, BAL Forever White Grout is applied to create a 100% watertight seal. \r\n', '4', '', '', '22485'),
