(0, '1839', '2701', '', '', 'Discoloured Silicone Around UPVC Window', '1', '', '135', 'The silicone around the UPVC window is showing signs of discolouration and decay. You would love the whole window area to be restored to fresh, Ice white condition.', 'Perform UPVC Window Restoration Including Silicone Replacement Using special solvents and compounds, the UPVC window frame, glass and surrounding area is restored back to a bright white glossy finish.The handle and mechanism would then be picked scraped and scrubbed with scalpels and fine blades to remove any surface corrosion.Black rubber gaskets round the window would be treated with non-corrosive chemicals to remove any remaining mould or mildew.The window frame would then be brought back to ice white condition using a chemical UPVC restorer applied with ultra fine cloths that do not scratch the surface.Finally, all silicone around the window frame area would be replaced with brand new, fresh, ice white silicone to leave the area fully restored.', 'Perform Silicone Replacement to Window Frame and Sill Area', '	We cut out the old silicone around the window area using low impact, none abrasive techniques and tools to avoid damage to any surfaces. \r\n\r\n	A special chemical sealant remover is then applied to all surfaces to remove any microscopic silicone or adhesive residue which could affect the adhesion of the new trims and silicone. \r\n\r\n	We replace the silicone with high quality ForeverWhite silicone which contains microban to prevent future mould growth. All new silicone is applied with a water repelling chamfer which encourages water to drain from the seal and avoid any mould re-growth.\r\n', '4', 'Core', 'https://lh3.googleusercontent.com/-mldXXaN3QLA/T_RcUh64JvI/AAAAAAAAEy8/rKqsHIYvJe8/s800/IMG_7452.JPG', '22485'),
