(0, '1863', '2709', '', '', 'CHANGED Decay & Black Mould on Silicone Around Shower Tray & Tile Joints', '1', '', '1500', 'The silicone seal around the shower tray & vertical wall tile joints is showing signs of black mould and decay. This is primarily caused by moisture and soap residue that can linger on the seal as it dried out.', '<<<<<<<<<<<CHANGED>>>>>>>>>>>The silicone seal around the shower tray & vertical wall tile joints is showing signs of black mould and decay. This is primarily caused by moisture and soap residue that can linger on the seal as it dried out.', 'Perform Silicone Seal Replacement Around Shower Tray & Vertical Wall Tile Joints', '	We cut out the old silicone around the shower tray using low impact, none abrasive techniques and tools to avoid damage to any surfaces. \r\n\r\n	A special chemical sealant remover is then applied to all surfaces to remove any microscopic silicone or adhesive residue which could affect the adhesion of the new trims and silicone. \r\n\r\n	We replace the silicone with high quality ForeverWhite silicone which contains microban to prevent future mould growth. All new silicone is applied with a water repelling chamfer which encourages water to drain from the seal and avoid any mould re-growth.\r\n', '4', 'Core', 'https://lh5.googleusercontent.com/-MFh4tRpbGbE/UAMi4ZtMMYI/AAAAAAAAH5o/jVCoyevmSa0/s800/IMG_7662.JPG', '22485'),
(0, '1867', '2709', '', '', 'Lime scale Build Up To Shower Door & Accessories', '1', '', '130', 'The shower cubicle glass, riser rail and shower head are showing signs of lime scale build up that is naturally present in the water.  The chalky type residue can clog shower heads and also causes the shower glass to have a cloudy appearance.', 'The shower cubicle glass, riser rail and shower head are showing signs of lime scale build up that is naturally present in the water.  The chalky type residue can clog shower heads and also causes the shower glass to have a cloudy appearance.', 'Perform Full Chemical Anti-Lime Scale Treatment to Shower Cubicle Glass, Riser Rail Hose and Shower Head', '	The shower door frame and glass undergo a special Viakal chemical treatment which loosens any mould, limescale and mildew. \r\n\r\n	Using rubber scrapers, fine scalpels and blades: we pick, scrape, scrub, and de-scale, every crevice to remove all stubborn traces of mould and lime Scale that have resisted the chemical treatment.\r\n\r\n	Finally we sanitise, buff and polish all glass and frames to really bring back the shine and leave them fully restored.\r\n', '4', 'Core', 'https://lh5.googleusercontent.com/-TPgsmIrOn0g/UAMi17eawqI/AAAAAAAAH5Y/qEQ_WWvTLKw/s800/IMG_7660.JPG', '22485'),
(0, '1869', '2709', '', '', 'Glass Shower Screen, Shower Head, and Shower Waste All Showing Signs of Lime Scale & Mildew Build up ', '1', '', '145', 'Your shower head, riser rail, hose and shower door are all showing signs of lime scale build up which has dulled their shine. These items can be treated to a sanitizing chemical restoration that will remove all traces of dirt, lime scale and restore their shine. ', 'Your shower head, riser rail, hose and shower door are all showing signs of lime scale build up which has dulled their shine. These items can be treated to a sanitizing chemical restoration that will remove all traces of dirt, lime scale and restore their shine. ', 'Perform Lime Scale Treatment to Glass Shower Screen & Shower Accessories ', '	The shower head, hose, riser rail & Glass undergo a special Viakal chemical treatment which loosens any mould, limescale and mildew. \r\n\r\n	Using rubber scrapers, fine scalpels and blades: we pick, scrape, scrub, and de-scale, every crevice to remove all stubborn traces of mould and lime Scale that have resisted the chemical treatment.\r\n\r\n	Finally we sanitise, buff and polish all metal work to really bring back the shine and leave them fully restored.\r\n', '4', 'Core', 'https://lh5.googleusercontent.com/-TPgsmIrOn0g/UAMi17eawqI/AAAAAAAAH5Y/qEQ_WWvTLKw/s800/IMG_7660.JPG', '22485'),
(0, '1871', '2709', '', '', 'Small Bath Screen & Bath Panel Are Loose ', '1', '', '110', 'The small but effective bath screen and the bath panel itself are both loose. This leaves the areas vulnerable to water penetration.', 'The small but effective bath screen and the bath panel itself are both loose. This leaves the areas vulnerable to water penetration.', 'Re-Fix & Re-Seal Small Bath Screen & Corner Quadrant Bath Panel', '	The bath screen & corner quadrant bath panel are carefully removed and treated to remove any remaining silicone or adhesive residue.\r\n\r\n	The restored screen and panel are fixed firmly into place using industrial strength adhesive and additional clips and bracket where appropriate to ensure a rock solid finish.\r\n\r\n	The screen and panel are then resealed using high quality ForeverWhite silicone which contains microban to prevent future mould growth. All new silicone is applied with a water repelling chamfer which encourages water to drain from the seal and avoid any mould re-growth.\r\n', '4', 'Core', 'https://lh3.googleusercontent.com/-WG6CRtYYfTg/UAMi03pM3mI/AAAAAAAAH5Q/tgAc2El5ZT8/s800/IMG_7659.JPG', '22485'),
(0, '1873', '2709', '', '', 'Loose Wall Tiles in Shower Cubicle 111111111111', '1', '', '125', 'It appears that water has penetrated beneath the wall tiles in the shower cubicle. At least 2 wall tiles at the base of the wall are showing evidence of movement which indicates that the plaster below has been affected.  ', 'It appears that water has penetrated beneath the wall tiles in the shower cubicle. At least 2 wall tiles at the base of the wall are showing evidence of movement which indicates that the plaster below has been affected.  The perfect solution would be to remove the affected tiles, replace the damaged plaster beneath and replace the tiles leaving the area rock solid. 1111111111111111111111111111', 'Remove Loose Wall Tiles & Perform Plasterboard Repair to Shower Cubicle', '	Using our specialist grout removal tools we remove any loose tiles and any old adhesive and grout to prepare the tiles for re-fitting later on.\r\n\r\n	Any damp and decayed plaster is removed and new Plasterboard is cut to size and fixed in place of the old, damaged plaster using high quality plasterboard adhesive.  \r\n\r\n	The tiles are re-fixed to the wall with high quality, fast drying adhesive to allow the fix without slowing down the rest of your bathroom restoration.\r\n\r\n	High quality, BAL Forever White Grout is applied to create a 100% watertight seal. \r\n', '4', 'Core', 'https://lh3.googleusercontent.com/-Cs_CjwKK9ZQ/UAMi2k11BzI/AAAAAAAAH5g/bQXXx0QpxjM/s800/IMG_7661.JPG', '22485'),
