(0, '1885', '2727', '', '', 'Silicone Replacement Around Shower Tray', '1', '', '170', 'Silicone Around the Shower Tray Showing Signs of Decay & Black Mould Growth', 'The silicone around the shower tray is showing signs of decay & black mould growth. The primary cause of this is moisture and soap residue that sits on the silicone and gradually discolours over time.', 'Perform Silicone Replacement Around The Shower Tray', ' We cut out the old silicone around the shower tray using low impact, none abrasive techniques and tools to avoid damage to any surfaces. \r\n\r\n A special chemical sealant remover is then applied to all surfaces to remove any microscopic particles of silicone residue which could affect the adhesion of the new silicone.\r\n\r\n We replace the silicone with high quality ForeverWhite silicone which contains microban to prevent future mould growth. All new silicone is applied with a water repelling chamfer which encourages water to drain from the seal and helps to avoid any mould re-growth.\r\n', '4', 'Upsell', 'https://lh4.googleusercontent.com/-ro3tkyoNmPQ/UB6Rj__W-uI/AAAAAAAALko/vyoTIr-mkOY/s800/IMG_8058.JPG', '22485'),
(0, '1887', '2727', '', '', 'Wall Tile Grout Replacement (Shower Cubicle)', '1', '', '90', 'Wall Tile Grout in the Shower Cubicle is Showing Signs of Severe Discolouration & Decay ', 'The wall tile grout around the shower cubicle is showing signs of severe discolouration and decay in many areas. Discolouration of wall tile grout is primarily caused by soap residue that lingers on the wall tiles after the shower has been used and gradually discolours over time. This type of severe discolouration is most effectively treated by replacing the wall tile grout around the shower cubicle area. ', 'Perform Full Wall Tile Grout Replacement Around The Shower Cubicle ', ' All grout is removed from the wall tiles with professional grade machinery that is fitted with brand new, ultra sharp blades to reduce impact to the tiles.\r\n\r\n We apply brand new, fresh grout to the wall tiles. All tile grout that we use is top quality Forever White grout that contains microban which is specifically designed to prevent mould and mildew growth.\r\n\r\n We carefully buff all tiled surfaces to remove excess grout and leave the tiles looking freshly installed.\r\n', '4', 'Core', 'https://lh6.googleusercontent.com/-PCx3GJSeUdw/UBZy2sZNhyI/AAAAAAAAK_Q/OrqEOTM_9zA/s800/IMG_7868.JPG', '22485'),
(0, '1889', '2727', '', '', 'Anti-Limescale Treatment to Glass & Shower Accessories ', '1', '', '175', 'Shower Glass, Shower Riser Rail & Shower Head are Showing Signs of Lime Scale Build Up', 'Your shower glass, shower head and shower riser rail are showing signs of lime scale build up which can cause a white cloudy residue on the glass. Limescale that is naturally present in the water can cause corrosion to shower door mechanisms, bathroom metalwork and shower nozzles.', 'Perform Anti-LimeScale Treatment to Shower Glass, Shower Riser Rail & Shower Head', ' The shower head, hose, riser rail & Glass undergo a special Viakal chemical treatment which loosens any mould, limescale and mildew. \r\n\r\n Using rubber scrapers, fine scalpels and blades: we pick, scrape, scrub, and de-scale, every crevice to remove all stubborn traces of mould and lime Scale that have resisted the chemical treatment.\r\n\r\n Finally we sanitise, buff and polish all metal work to really bring back the shine and leave them fully restored.', '4', 'Core', 'https://lh5.googleusercontent.com/-3NPDy8oiVak/UBZy4QdRqLI/AAAAAAAAK_g/Lime9yVwkV8/s800/IMG_7869.JPG', '22485'),
(0, '1891', '2727', '', '', 'Supply & Fit W/C Seat', '1', '', '0', 'Toilet Seat Requires Replacement', 'You have highlighted your toilet seat as an item that you would like to be replaced.', 'Supply & Fit Replacement Toilet Seat ', ' You choose a suitable style of replacement toilet seat from our wide range of trade suppliers. \r\n\r\n We remove the old seat and perform a light restoration of the area beneath the fixings & hinges which can often be an area where dirt and discolouration builds up over time.\r\n\r\nThe new seat is fitted and tightened to ensure a perfect fit.', '4', 'Core', 'https://lh5.googleusercontent.com/-N8OdqrqrnpE/UBZy_6MrOnI/AAAAAAAAK_w/0ZqnPY5qTHU/s800/IMG_7875.JPG', '22485'),
(0, '1893', '2727', '', '', 'Chemical Restoration to Shower Cubicle Gaskets', '1', '', '0', 'Shower Cubicle Gaskets Are Showing Signs of Decay & Discolouration', 'The Shower Cubicle Gaskets (seals) are showing signs of discolouration. This is typically caused by soap residue and moisture build up that occurs when the shower is in use and is then left to dry out.', 'Perform Full Chemical Restoration to Shower Cubicle Gaskets and Trims', ' The shower cubicle gaskets and trims are carefully removed and are immersed is a restoration chemical which breaks down any build up of discolouration.\r\n\r\n For particularly stubborn discoloration deposits, we use soft bristle brushes and light abrasive scrapers to restore the gaskets.\r\n\r\n The gaskets and trims are washed with detergent and water to remove all traces of chemical before they are re-fitted to the shower cubicle.\r\n', '4', 'Core', 'https://lh5.googleusercontent.com/-yuMoiqwnTdM/UBZy1G9yFXI/AAAAAAAAK_c/O0PinwejvD0/s800/IMG_7866.JPG', '22485'),
(0, '1895', '2727', '', '', 'Silicone Replacement to Kitchen Sink & Worktops', '1', '', '0', 'Silicone to the Rear of the Worktop & Around The Kitchen Sink is Showing Signs of Decay & Discolouration', 'The silicone to the rear of the kitchen worktops & around the sink is showing signs of decay and discolouration. Just like bathrooms, this problem is caused by excess moisture on the silicone but also cooking grease that can cause premature silicone wear and discolouration.', 'Perform Silicone Replacement to Rear of Kitchen Worktop & Around Sink', ' We cut out the existing silicone and along the rear of the worktop using low impact, none abrasive techniques and tools.\r\n\r\n Using a special chemical sealant remover and a fine scalpel, we remove any remaining silicone residue.\r\n\r\n We replace the silicone with high quality ForeverWhite which contains microban to prevent mould and mildew growth. All new silicone is applied with a water repelling chamfer to ensure a longer lasting seal that is 100% effective.\r\n', '4', 'Core', 'https://lh4.googleusercontent.com/-eUgppkK_gc0/UBZyz3HOu9I/AAAAAAAAK_Y/7Um_WssigAk/s800/IMG_7865.JPG', '22485'),
(0, '1897', '2727', '', '', 'Grout Removal to Entire Room', '1', '', '0', '', '', 'Perform Grout Renewal to Entire Room', 'To give your bathroom the complete ice white, wow factor, you may like to instruct us to extend the grout renewal to cover the entire room. Our client testimonials show time and time again that this is the most effective way to give a new lease of life to the entire room for a fraction of the cost of new tiles.\r\n', '4', 'Core', 'https://lh5.googleusercontent.com/-9snQCTJaH_Q/UBZy9UUd7KI/AAAAAAAAK_o/BQqVB-ifvdQ/s800/IMG_7873.JPG', '22485'),
(0, '1899', '2727', '', '', 'Silicone Replacement Around Hand Basin', '1', '', '0', '', '', 'Perform Silicone Replacement To Rear of Hand Basin', 'You might like to consider including replacement silicone around the hand basin in your quote which will ensure a neat, ice white, decay free finish to your basin which will match the other restored areas in your bathroom.', '4', 'Core', 'https://lh4.googleusercontent.com/-SNkd0Ex-_RU/UBZy-kzja7I/AAAAAAAAK_s/t526dxYt6E4/s800/IMG_7874.JPG', '22485'),
(0, '1901', '2727', '', '', 'Silicone Replacement Around Bath with Trims', '1', '', '0', '', '', 'Perform Silicone & Trim Replacement Around The Bath', 'You might like to consider replacement of the trims and silicone around the bath area to really enhance your bathroom restoration and match your ice white shower area.', '4', 'Core', 'https://lh3.googleusercontent.com/-Q8KVx2iSd8Y/UBZy8lc-uAI/AAAAAAAAK-Q/pZEWYg53s5w/s800/IMG_7872.JPG', '22485'),
(0, '1934', '2752', '', '', 'Wall Tile Grout Chemical Restoration (Bath Area)', '1', '', '120', 'Wall Tile Grout Around the Bath Area is Showing Signs of Discolouration & Decay', 'The wall tile grout around the bath area is showing signs of light discolouration and may have decayed in some areas. Discolouration of wall tile grout is primarily caused by soap residue that lingers on the wall tiles after the shower has been used and gradually discolours over time. This type of light discolouration can be effectively treated with a chemical grout restoration which will achieve excellent results. ', 'Perform Full Chemical Restoration to Wall Tile Grout Around The Bath Area', ' All wall tile grout around the Bath Area undergoes a special chemical treatment which loosens any discolouration and dirt that is present on the grout.\r\n\r\n Our team go to work on the grout with brushes, scalpels, scrapers and picks to remove all stubborn residue that may have resisted the initial chemical treatment. \r\n\r\nAny decayed or missing grout is repaired using top quality, ice white grout and the tiles are then washed and buffed to leave them looking pristine.\r\n', '4', 'Core', 'https://lh5.googleusercontent.com/-iRO3aCIow0A/UBvABJKh2kI/AAAAAAAALfw/UDhJkjP2sPc/s800/IMG_8040.JPG', '22485'),
(0, '1904', '2697', '', '', 'LED Light Swap Outs', '1', '', '0', '', '', 'Replace Bathroom Down Lights with Long Lasting, Super Bright, Energy Efficient LED Lighting ', 'LED downlights are the most advanced type of downlight available and outperform conventional lighting in every way. As well as providing energy savings of 80-90%, they can last from 25,000 to 75,000 hours (depending which type you choose). With an average use of 6 hours per day, LED downlights will last between 15 and 30 years. For every 40 halogens you purchase over the same time period, just 1 LED would do! \r\n\r\nSwapping your conventional downlights for LEDs is a very straight forward process that not only saves money but improves the look of any bathroom with a bright, crystal clear light that is available with a choice of subtle colour tints as well as conventional, white. ', '4', 'Core', 'https://lh6.googleusercontent.com/-7lBsKWwod-c/T95ri5oM_VI/AAAAAAAAC6s/5EQxIAA6TCo/s800/Bathrooms%252525252014%2525252520June%2525252520049.jpg', '22485'),
(0, '1920', '2723', '', '', 'Silicone Replacement Around Bath Tub', '1', '', '135', 'Silicone Around the Bath Tub is Showing Signs of Decay & Black Mould Growth', 'The silicone around the bath tub is showing signs of decay & black mould growth. The primary cause of this is moisture and soap residue that sits on the silicone and gradually discolours over time.', 'Solution: Perform Silicone Replacement Around The Bath Tub', ' We cut out the old silicone around the bath tub using low impact, none abrasive techniques and tools to avoid damage to any surfaces. \r\n\r\n A special chemical sealant remover is then applied to all surfaces to remove any microscopic silicone residue which could affect the adhesion of the new silicone.\r\n\r\n We replace the silicone with high quality ForeverWhite silicone which contains microban to prevent future mould growth. All new silicone is applied with a water repelling chamfer which encourages water to drain from the seal and help to avoid any mould re-growth.\r\n\r\n', '4', 'Core', 'https://lh4.googleusercontent.com/-5poE3572Pn0/UBvAT59FXVI/AAAAAAAALhY/EK8J8FxJzKs/s800/IMG_8053.JPG', '22485'),
(0, '1908', '2727', '', '', 'Apply Tile Polish', '1', '', '0', '', '', 'Apply Tile Polish to All Tiled Surfaces To Really Enhance Their Shine', 'Applying Tile Polish to the wall or floor tiles after the work has been performed will not only make your tiles look fantastic but can also help to prevent future discolouration. The polish acts in exactly the same way as car body polish in that it encourages water to run off the surface leaving them shiny and streak free for longer. ', '4', 'Upsell', '', '22485'),
(0, '1910', '2728', '', '', 'Silicone Replacement Around Shower Tray', '1', '', '170', 'Silicone Around the Shower Tray Showing Signs of Decay & Black Mould Growth', 'The silicone around the shower tray is showing signs of decay & black mould growth. The primary cause of this is moisture and soap residue that sits on the silicone and gradually discolours over time.', 'Perform Silicone Replacement Around The Shower Tray', ' We cut out the old silicone around the shower tray using low impact, none abrasive techniques and tools to avoid damage to any surfaces. \r\n\r\n A special chemical sealant remover is then applied to all surfaces to remove any microscopic particles of silicone residue which could affect the adhesion of the new silicone.\r\n\r\n We replace the silicone with high quality ForeverWhite silicone which contains microban to prevent future mould growth. All new silicone is applied with a water repelling chamfer which encourages water to drain from the seal and helps to avoid any mould re-growth.\r\n', '4', 'Core', 'https://lh6.googleusercontent.com/-Oh0vTb3Bu5M/UBu_u-wbOjI/AAAAAAAALjY/m8lX6ugiDQk/s800/IMG_8027.JPG', '22485'),
(0, '1912', '2728', '', '', 'LED Light Swap Outs', '1', '', '0', '', '', 'Replace Bathroom Down Lights with Long Lasting, Super Bright, Energy Efficient LED Lighting ', 'LED downlights are the most advanced type of downlight available and outperform conventional lighting in every way. As well as providing energy savings of 80-90%, they can last from 25,000 to 75,000 hours (depending which type you choose). With an average use of 6 hours per day, LED downlights will last between 15 and 30 years. For every 40 halogens you purchase over the same time period, just 1 LED would do! \r\n\r\nSwapping your conventional downlights for LEDs is a very straight forward process that not only saves money but improves the look of any bathroom with a bright, crystal clear light that is available with a choice of subtle colour tints as well as conventional, white. ', '4', 'Upsell', 'https://lh4.googleusercontent.com/-zLxfadFJOPM/UBu_otcGeYI/AAAAAAAALjA/E9-L9Xj-DhU/s800/IMG_8022.JPG', '22485'),
(0, '1914', '2728', '', '', 'Silicone Replacement Around Bath Tub', '1', '', '135', 'Silicone Around the Bath Tub is Showing Signs of Decay & Black Mould Growth', 'The silicone around the bath tub is showing signs of decay & black mould growth. The primary cause of this is moisture and soap residue that sits on the silicone and gradually discolours over time.\r\n', 'Solution: Perform Silicone Replacement Around The Bath Tub', ' We cut out the old silicone around the bath tub using low impact, none abrasive techniques and tools to avoid damage to any surfaces. \r\n\r\n A special chemical sealant remover is then applied to all surfaces to remove any microscopic silicone residue which could affect the adhesion of the new silicone.\r\n\r\n We replace the silicone with high quality ForeverWhite silicone which contains microban to prevent future mould growth. All new silicone is applied with a water repelling chamfer which encourages water to drain from the seal and help to avoid any mould re-growth.\r\n\r\n', '4', 'Core', '', '22485'),
(0, '1916', '2728', '', '', 'Wall Tile Grout Chemical Restoration (Shower Cubicle)', '1', '', '130', 'Wall Tile Grout in the Shower Cubicle is Showing Signs of Discolouration & Decay', 'The wall tile grout around the shower cubicle is showing signs of light discolouration and may have decayed in some areas. Discolouration of wall tile grout is primarily caused by soap residue that lingers on the wall tiles after the shower has been used and gradually discolours over time. \r\n\r\nThis type of light discolouration can be effectively treated with a chemical grout restoration which will achieve excellent results. \r\n\r\n', 'Perform Full Chemical Restoration to Wall Tile Grout Around Shower Cubicle', ' All wall tile grout around the shower cubicle undergoes a special chemical treatment which loosens any discolouration and dirt that is present on the grout.\r\n\r\n Our team go to work on the grout with brushes, scalpels, scrapers and picks to remove all stubborn residue that may have resisted the initial chemical treatment. \r\n\r\nAny decayed or missing grout is repaired using top quality, ice white grout and the tiles are then washed and buffed to leave them looking pristine. ', '4', 'Core', '', '22485');
INSERT INTO `orderitem` (`tableID`, `Id`, `OrderId`, `ProductId`, `SubscriptionPlanId`, `ItemName`, `Qty`, `CPU`, `PPU`, `ItemDescription`, `ItemDescription2`, `ItemDescription3`, `ItemDescription4`, `ItemType`, `Notes`, `picasaURL`, `_dID`) VALUES
(0, '1918', '2728', '', '', 'Preventative product name', '1', '', '0', '', '', 'Preventative product solution brief', 'Preventative product solution in depth in depth in depth in depth in depth in depth in depth in depth in depth in depth in depth in depth in depth in depth in depth in depth in depth in depth in depth in depth in depth in depth in depth in depth in depth in depth in depth in depth', '4', 'Preventative', 'https://lh6.googleusercontent.com/-bQhoCLM1orY/UBu_1e3529I/AAAAAAAALjw/8nVNyHmWSGU/s800/IMG_8032.JPG', '22485'),
(0, '1922', '2723', '', '', 'Wall Tile Grout Replacement (Whole Room)', '1', '', '125', 'Wall Tile Grout in the Bathroom is Showing Signs of Severe Discolouration & Decay ', 'The wall tile grout in the Bathroom is showing signs of severe discolouration and decay in many areas. Discolouration of wall tile grout is primarily caused by soap residue that lingers on the wall tiles after the shower has been used and gradually discolours over time. This type of severe discolouration is most effectively treated by replacing the wall tile grout around the entire room.', 'Perform Full Wall Tile Grout Replacement In Bathroom', ' All grout is removed from the wall tiles with professional grade machinery that is fitted with brand new, ultra sharp blades to reduce impact to the tiles.\r\n\r\n We apply brand new, fresh grout to the wall tiles. All tile grout that we use is top quality Forever White grout that contains microban which is specifically designed to prevent mould and mildew growth.\r\n\r\n We carefully buff all tiled surfaces to remove excess grout and leave the tiles looking freshly installed.\r\n', '4', 'Core', 'https://lh3.googleusercontent.com/-AY1TPmUVw8k/UBvAEq41KVI/AAAAAAAALiE/s7JaIPh6Nvk/s800/IMG_8043.JPG', '22485'),
(0, '1924', '2723', '', '', 'Perform Deep Clean to Bathroom', '1', '', '0', '', '', 'Perform Deep Hygienic Chemical Clean to All Bathroom Surfaces', 'Once your main restoration work is complete we can treat your bathroom to a full surface deep clean which gets into all the hard to reach places such as behind the W/C & Basin, plugholes, overflows, and taps to leave your bathroom sparkling.  ', '4', 'Upsell', 'https://lh6.googleusercontent.com/-BdfYD5K8A-M/UBvAIf5NN-I/AAAAAAAALiY/sdzPmbd2IbA/s800/IMG_8046.JPG', '22485'),
(0, '1926', '2723', '', '', 'Silicone Replacement Around Bath with Trims', '1', '', '0', '', '', 'Perform Silicone & Trim Replacement Around The Bath', 'You might like to consider replacement of the trims and silicone around the bath area to really enhance your bathroom restoration and match your ice white shower area.', '4', 'Upsell', 'https://lh6.googleusercontent.com/-TpfXrUdxJJs/UBvAMCx-ekI/AAAAAAAALig/C6M5H_bF0WA/s800/IMG_8048.JPG', '22485'),
(0, '1928', '2723', '', '', 'Preventative product name', '1', '', '0', '', '', 'Preventative product solution brief', 'Preventative product solution in depth in depth in depth in depth in depth in depth in depth in depth in depth in depth in depth in depth in depth in depth in depth in depth in depth in depth in depth in depth in depth in depth in depth in depth in depth in depth in depth in depth', '4', 'Preventative', 'https://lh6.googleusercontent.com/-imatobD72lU/UBu_3shANoI/AAAAAAAALhs/UV6w_NHferk/s800/IMG_8033.JPG', '22485'),
(0, '1932', '2752', '', '', 'Silicone Replacement Around Bath Tub', '1', '', '135', 'Silicone Around the Bath Tub is Showing Signs of Decay & Black Mould Growth', 'The silicone around the bath tub is showing signs of decay & black mould growth. The primary cause of this is moisture and soap residue that sits on the silicone and gradually discolours over time.', 'Solution: Perform Silicone Replacement Around The Bath Tub', ' We cut out the old silicone around the bath tub using low impact, none abrasive techniques and tools to avoid damage to any surfaces. \r\n\r\n A special chemical sealant remover is then applied to all surfaces to remove any microscopic silicone residue which could affect the adhesion of the new silicone.\r\n\r\n We replace the silicone with high quality ForeverWhite silicone which contains microban to prevent future mould growth. All new silicone is applied with a water repelling chamfer which encourages water to drain from the seal and help to avoid any mould re-growth.\r\n\r\n', '4', 'Core', 'https://lh6.googleusercontent.com/-lstcmYdU94k/UBvACKj69DI/AAAAAAAALf4/vmg2qCiYV8E/s800/IMG_8041.JPG', '22485'),
(0, '1936', '2752', '', '', 'Anti-Mould Treatment to Ceiling', '1', '', '69', 'Bathroom Ceiling is Showing Signs of Black Mould Growth ', 'The bathroom ceiling is showing signs of black mould growth. This is caused by condensation and lack of air flow to the bathroom when the bath and shower are in use. A anti-mould treatment can remove all traces of black mould and return your bathroom ceiling to perfect condition.', 'Perform Full Anti-Mould Treatment To Affected Areas on Bathroom Ceiling ', ' The Bathroom ceiling is treated with a special anti-mould/anti-fungal wash which penetrates deep into all types of condensation related mould. \r\n\r\n Using non-abrasive rubber scrapers and neat chemicals, we remove any stubborn mould deposits from all corners and hard to reach areas.\r\n\r\n Any excess chemicals are removed from the ceiling and the area is given a final diluted treatment which discourages future mould regrowth.\r\n', '4', 'Core', 'https://lh6.googleusercontent.com/-BdfYD5K8A-M/UBvAIf5NN-I/AAAAAAAALiY/sdzPmbd2IbA/s800/IMG_8046.JPG', '22485'),
(0, '1938', '2752', '', '', 'Silicone Replacement Around Hand Basin', '1', '', '160', 'Silicone To The Rear of The Hand Basin is Showing Signs of Decay & Black Mould Growth', 'The silicone to the rear of the hand basin is showing signs of decay & black mould growth. The primary cause of this is moisture and soap residue that sits on the silicone and gradually discolours over time.', 'Perform Silicone Replacement To Rear of Hand Basin', ' We cut out the old silicone around the hand basin using low impact, none abrasive techniques and tools to avoid damage to any surfaces. \r\n\r\n A special chemical sealant remover is then applied to all surfaces to remove any microscopic particles of silicone residue which could affect the adhesion of the new silicone.\r\n\r\n We replace the silicone with high quality ForeverWhite silicone which contains microban to prevent future mould growth. All new silicone is applied with a water repelling chamfer which encourages water to drain from the seal and helps to avoid any mould re-growth.\r\n', '4', 'Core', 'https://lh6.googleusercontent.com/-TpfXrUdxJJs/UBvAMCx-ekI/AAAAAAAALig/C6M5H_bF0WA/s800/IMG_8048.JPG', '22485'),
(0, '1940', '2752', '', '', 'Anti-Limescale Treatment to Glass & Shower Accessories ', '1', '', '175', 'Shower Glass, Shower Riser Rail & Shower Head are Showing Signs of Lime Scale Build Up', 'Your shower glass, shower head and shower riser rail are showing signs of lime scale build up which can cause a white cloudy residue on the glass. Limescale that is naturally present in the water can cause corrosion to shower door mechanisms, bathroom metalwork and shower nozzles.', 'Perform Anti-LimeScale Treatment to Shower Glass, Shower Riser Rail & Shower Head', ' The shower head, hose, riser rail & Glass undergo a special Viakal chemical treatment which loosens any mould, limescale and mildew. \r\n\r\n Using rubber scrapers, fine scalpels and blades: we pick, scrape, scrub, and de-scale, every crevice to remove all stubborn traces of mould and lime Scale that have resisted the chemical treatment.\r\n\r\n Finally we sanitise, buff and polish all metal work to really bring back the shine and leave them fully restored.', '4', 'Core', 'https://lh5.googleusercontent.com/-d16HYCdG81M/UBu_7mo_hJI/AAAAAAAALh4/_JPzO2eAooc/s800/IMG_8036.JPG', '22485'),
(0, '1942', '2752', '', '', 'Grout Removal to Entire Room', '1', '', '0', '', '', 'Perform Grout Renewal to Entire Room', 'To give your bathroom the complete ice white, wow factor, you may like to instruct us to extend the grout renewal to cover the entire room. Our client testimonials show time and time again that this is the most effective way to give a new lease of life to the entire room for a fraction of the cost of new tiles.\r\n', '4', 'Upsell', 'https://lh5.googleusercontent.com/-d16HYCdG81M/UBu_7mo_hJI/AAAAAAAALh4/_JPzO2eAooc/s800/IMG_8036.JPG', '22485'),
(0, '1944', '2752', '', '', 'Perform Deep Clean to Bathroom', '1', '', '0', '', '', 'Perform Deep Hygienic Chemical Clean to All Bathroom Surfaces', 'Once your main restoration work is complete we can treat your bathroom to a full surface deep clean which gets into all the hard to reach places such as behind the W/C & Basin, plugholes, overflows, and taps to leave your bathroom sparkling.  ', '4', 'Upsell', 'https://lh3.googleusercontent.com/-6fsD55dxMfc/UBu_6JPjLHI/AAAAAAAALh0/uM6KYsNcJ3o/s800/IMG_8035.JPG', '22485'),
(0, '1946', '2752', '', '', 'LED Light Swap Outs', '1', '', '0', '', '', 'Replace Bathroom Down Lights with Long Lasting, Super Bright, Energy Efficient LED Lighting ', 'LED downlights are the most advanced type of downlight available and outperform conventional lighting in every way. As well as providing energy savings of 80-90%, they can last from 25,000 to 75,000 hours (depending which type you choose). With an average use of 6 hours per day, LED downlights will last between 15 and 30 years. For every 40 halogens you purchase over the same time period, just 1 LED would do! \r\n\r\nSwapping your conventional downlights for LEDs is a very straight forward process that not only saves money but improves the look of any bathroom with a bright, crystal clear light that is available with a choice of subtle colour tints as well as conventional, white. ', '4', 'Upsell', 'https://lh6.googleusercontent.com/-yPbxS0oJyDI/UBvAVzt_z2I/AAAAAAAALi4/NGpMLU_lIQ8/s800/IMG_8055.JPG', '22485'),
(0, '1948', '2754', '', '', 'Silicone Replacement Around Shower Tray with Trims', '1', '', '150', 'Silicone & Trims Around the Shower Tray Are Showing Signs of Decay & Black Mould Growth', 'The silicone & trims around the shower tray are showing signs of decay & black mould growth. The primary cause of this is moisture and soap residue that sits on the silicone & trims and gradually discolours them over time.', 'Perform Silicone & Trim Replacement Around The Shower Tray', ' We cut out the old silicone & trims around the shower tray using low impact, none abrasive techniques and tools to avoid damage to any surfaces. \r\n\r\n A special chemical sealant remover is then applied to all surfaces to remove any microscopic particles of silicone residue which could affect the adhesion of the new silicone.\r\n\r\n We install high gloss white, UPVC quadrant trims around the shower tray that are held in place with industrial strength adhesive to form an extra layer of protection against water penetration. \r\n\r\n The trims are then sealed with high quality ForeverWhite silicone which contains microban to help prevent future mould growth. All new silicone is applied with a water repelling chamfer which encourages water to drain from the seal and help to avoid any mould re-growth.\r\n\r\n', '4', 'Core', 'https://lh3.googleusercontent.com/-PZw1w5uq2FU/UCDtIfo9pZI/AAAAAAAALvw/S94atnct7-U/s800/IMG_8118.JPG', '22485'),
