(0, '1984', '2798', '', '', 'Silicone Replacement Around Shower Tray', '1', '', '170', 'Silicone Around the Shower Tray Showing Signs of Decay & Black Mould Growth', 'The silicone around the shower tray is showing signs of decay & black mould growth. The primary cause of this is moisture and soap residue that sits on the silicone and gradually discolours over time.\r\n\r\n', 'Perform Silicone Replacement Around The Shower Tray', ' We cut out the old silicone around the shower tray using low impact, none abrasive techniques and tools to avoid damage to any surfaces. \r\n\r\n A special chemical sealant remover is then applied to all surfaces to remove any microscopic particles of silicone residue which could affect the adhesion of the new silicone.\r\n\r\n We replace the silicone with high quality ForeverWhite silicone which contains microban to prevent future mould growth. All new silicone is applied with a water repelling chamfer which encourages water to drain from the seal and helps to avoid any mould re-growth.\r\n', '4', 'Core', '', '22485');
