(1, 265, 'Silicone Replacement Around Bath Tub', 135, '22485', 'Silicone Around the Bath Tub is Showing Signs of Decay & Black Mould Growth', 0, 0, 0, 0, 0, 0, 0, 'The silicone around the bath tub is showing signs of decay & black mould growth. The primary cause of this is moisture and soap residue that sits on the silicone and gradually discolours over time.\r\n', 0, 0, 'Solution: Perform Silicone Replacement Around The Bath Tub', ' We cut out the old silicone around the bath tub using low impact, none abrasive techniques and tools to avoid damage to any surfaces. \r\n\r\n A special chemical sealant remover is then applied to all surfaces to remove any microscopic silicone residue which could affect the adhesion of the new silicone.\r\n\r\n We replace the silicone with high quality ForeverWhite silicone which contains microban to prevent future mould growth. All new silicone is applied with a water repelling chamfer which encourages water to drain from the seal and help to avoid any mould re-growth.\r\n\r\n', '', '', 'Core', 0, 22485, 0, ''),
(0, 321, 'Anti-Mould Treatment to Ceiling', 69, '22485', 'Bathroom Ceiling is Showing Signs of Black Mould Growth ', 0, 0, 0, 0, 0, 0, 0, 'The bathroom ceiling is showing signs of black mould growth. This is caused by condensation and lack of air flow to the bathroom when the bath and shower are in use. \r\n\r\nA anti-mould treatment can remove all traces of black mould and return your bathroom ceiling to perfect condition.\r\n', 0, 0, 'Perform Full Anti-Mould Treatment To Affected Areas on Bathroom Ceiling ', ' The Bathroom ceiling is treated with a special anti-mould/anti-fungal wash which penetrates deep into all types of condensation related mould. \r\n\r\n Using non-abrasive rubber scrapers and neat chemicals, we remove any stubborn mould deposits from all corners and hard to reach areas.\r\n\r\n Any excess chemicals are removed from the ceiling and the area is given a final diluted treatment which discourages future mould regrowth.\r\n', '', '', 'Core', 0, 22485, 0, ''),
(2, 263, 'Silicone Replacement Around Shower Tray', 170, '22485', 'Silicone Around the Shower Tray Showing Signs of Decay & Black Mould Growth', 0, 0, 0, 0, 0, 0, 0, 'The silicone around the shower tray is showing signs of decay & black mould growth. The primary cause of this is moisture and soap residue that sits on the silicone and gradually discolours over time.\r\n\r\n', 0, 0, 'Perform Silicone Replacement Around The Shower Tray', ' We cut out the old silicone around the shower tray using low impact, none abrasive techniques and tools to avoid damage to any surfaces. \r\n\r\n A special chemical sealant remover is then applied to all surfaces to remove any microscopic particles of silicone residue which could affect the adhesion of the new silicone.\r\n\r\n We replace the silicone with high quality ForeverWhite silicone which contains microban to prevent future mould growth. All new silicone is applied with a water repelling chamfer which encourages water to drain from the seal and helps to avoid any mould re-growth.\r\n', '', '', 'Core', 0, 22485, 0, ''),
(6, 267, 'Silicone Replacement Around Shower Tray with Trims', 150, '22485', 'Silicone & Trims Around the Shower Tray Are Showing Signs of Decay & Black Mould Growth', 0, 0, 0, 0, 0, 0, 0, 'The silicone & trims around the shower tray are showing signs of decay & black mould growth. The primary cause of this is moisture and soap residue that sits on the silicone & trims and gradually discolours them over time.', 0, 0, 'Perform Silicone & Trim Replacement Around The Shower Tray', ' We cut out the old silicone & trims around the shower tray using low impact, none abrasive techniques and tools to avoid damage to any surfaces. \r\n\r\n A special chemical sealant remover is then applied to all surfaces to remove any microscopic particles of silicone residue which could affect the adhesion of the new silicone.\r\n\r\n We install high gloss white, UPVC quadrant trims around the shower tray that are held in place with industrial strength adhesive to form an extra layer of protection against water penetration. \r\n\r\n The trims are then sealed with high quality ForeverWhite silicone which contains microban to help prevent future mould growth. All new silicone is applied with a water repelling chamfer which encourages water to drain from the seal and help to avoid any mould re-growth.\r\n\r\n', '', '', 'Core', 0, 22485, 0, ''),
(3, 261, 'Decayed and Discoloured Wall Tile Grout ', 200, '18029', 'Decayed and Discoloured Wall Tile Grout  \r\n\r\nYou would love the whole window area to be restored to fresh, Ice white condition.', 0, 0, 0, 0, 0, 0, 0, '<p>\n  <strong><u>Perform UPVC Window Restoration Including Silicone Replacement </u></strong>\n</p><ul>\n<li>\n  Using special solvents and compounds, the UPVC window frame, glass and surrounding area is restored back to a bright white glossy finish.&nbsp;\n</li>\n</ul>\n<p>\n  &nbsp;\n</p><ul>\n<li>\n  The handle and mechanism would then be picked scraped and scrubbed with scalpels and fine blades to remove any surface corrosion.\n</li>\n</ul>\n<p>\n  &nbsp;\n</p>\n<p>\n</p><ul>\n<li>\n  Black rubber gaskets round the window would be treated with non-corrosive chemicals to remove any remaining mould or mildew.\n</li>\n</ul>\n<p>\n  &nbsp;\n</p><ul>\n<li>\n  The window frame would then be brought back to ice white condition using a chemical UPVC restorer applied with ultra fine cloths that do not scratch the surface.\n</li>\n</ul>\n<p>\n  &nbsp;\n</p><ul>\n<li>\n  Finally, all silicone around the window frame area would be replaced with brand new, fresh, ice white silicone to leave the area fully restored.\n</li>\n</ul>', 0, 0, 'tophtmlllll', 'bottomhtmllll', '', '', 'PREVENTATIVE', 0, 0, 0, ''),
(16, 287, 'Silicone Replacement Around Bath Tub with Trims', 145, '22485', 'Silicone & Trims Around the Bath Tub Are Showing Signs of Decay & Black Mould Growth', 0, 0, 0, 0, 0, 0, 0, 'The silicone & trims around the bath tub are showing signs of decay & black mould growth. The primary cause of this is moisture and soap residue that sits on the silicone and gradually discolours over time.', 0, 0, 'Perform Silicone & Trim Replacement Around The Bath Tub', ' We cut out the old silicone & trims around the bath tub using low impact, none abrasive techniques and tools to avoid damage to any surfaces. \r\n\r\n A special chemical sealant remover is then applied to all surfaces to remove any microscopic particles of silicone residue which could affect the adhesion of the new silicone.\r\n\r\n We install high gloss white, UPVC quadrant trims around the bath tub that are held in place with industrial strength adhesive to form an extra layer of protection against water penetration. \r\n\r\n The trims are then sealed with high quality ForeverWhite silicone which contains microban to help prevent future mould growth. All new silicone is applied with a water repelling chamfer which encourages water to drain from the seal and help to avoid any mould re-growth.\r\n', '', '', 'Core', 0, 22485, 0, ''),
