(0, 295, 'Wall Tile Grout Chemical Restoration (Shower Cubicle)', 130, '22485', 'Wall Tile Grout in the Shower Cubicle is Showing Signs of Discolouration & Decay', 0, 0, 0, 0, 0, 0, 0, 'The wall tile grout around the shower cubicle is showing signs of light discolouration and may have decayed in some areas. Discolouration of wall tile grout is primarily caused by soap residue that lingers on the wall tiles after the shower has been used and gradually discolours over time. \r\n\r\nThis type of light discolouration can be effectively treated with a chemical grout restoration which will achieve excellent results. \r\n\r\n', 0, 0, 'Perform Full Chemical Restoration to Wall Tile Grout Around Shower Cubicle', ' All wall tile grout around the shower cubicle undergoes a special chemical treatment which loosens any discolouration and dirt that is present on the grout.\r\n\r\n Our team go to work on the grout with brushes, scalpels, scrapers and picks to remove all stubborn residue that may have resisted the initial chemical treatment. \r\n\r\nAny decayed or missing grout is repaired using top quality, ice white grout and the tiles are then washed and buffed to leave them looking pristine. ', '', '', 'Core', 0, 22485, 0, ''),
(0, 297, 'Wall Tile Grout Chemical Restoration (Bath Area)', 120, '22485', 'Wall Tile Grout Around the Bath Area is Showing Signs of Discolouration & Decay', 0, 0, 0, 0, 0, 0, 0, 'The wall tile grout around the bath area is showing signs of light discolouration and may have decayed in some areas. Discolouration of wall tile grout is primarily caused by soap residue that lingers on the wall tiles after the shower has been used and gradually discolours over time. \r\n\r\nThis type of light discolouration can be effectively treated with a chemical grout restoration which will achieve excellent results. \r\n', 0, 0, 'Perform Full Chemical Restoration to Wall Tile Grout Around The Bath Area', ' All wall tile grout around the Bath Area undergoes a special chemical treatment which loosens any discolouration and dirt that is present on the grout.\r\n\r\n Our team go to work on the grout with brushes, scalpels, scrapers and picks to remove all stubborn residue that may have resisted the initial chemical treatment. \r\n\r\nAny decayed or missing grout is repaired using top quality, ice white grout and the tiles are then washed and buffed to leave them looking pristine.\r\n', '', '', 'Core', 0, 22485, 0, ''),
(0, 299, 'Wall Tile Grout Replacement (Shower Cubicle)', 90, '22485', 'Wall Tile Grout in the Shower Cubicle is Showing Signs of Severe Discolouration & Decay ', 0, 0, 0, 0, 0, 0, 0, 'The wall tile grout around the shower cubicle is showing signs of severe discolouration and decay in many areas. Discolouration of wall tile grout is primarily caused by soap residue that lingers on the wall tiles after the shower has been used and gradually discolours over time. \r\n\r\nThis type of severe discolouration is most effectively treated by replacing the wall tile grout around the shower cubicle area. ', 0, 0, 'Perform Full Wall Tile Grout Replacement Around The Shower Cubicle ', ' All grout is removed from the wall tiles with professional grade machinery that is fitted with brand new, ultra sharp blades to reduce impact to the tiles.\r\n\r\n We apply brand new, fresh grout to the wall tiles. All tile grout that we use is top quality Forever White grout that contains microban which is specifically designed to prevent mould and mildew growth.\r\n\r\n We carefully buff all tiled surfaces to remove excess grout and leave the tiles looking freshly installed.\r\n', '', '', 'Core', 0, 22485, 0, ''),
(0, 301, 'Wall Tile Grout Replacement (Bath Area)', 110, '22485', 'Wall Tile Grout Around the Bath Area is Showing Signs of Severe Discolouration & Decay ', 0, 0, 0, 0, 0, 0, 0, 'The wall tile grout around the bath area is showing signs of severe discolouration and decay in many areas. Discolouration of wall tile grout is primarily caused by soap residue that lingers on the wall tiles after the shower has been used and gradually discolours over time. \r\n\r\nThis type of severe discolouration is most effectively treated by replacing the wall tile grout around the bath area.\r\n', 0, 0, 'Perform Full Wall Tile Grout Replacement Around The Bath Area', ' All grout is removed from the wall tiles with professional grade machinery that is fitted with brand new, ultra sharp blades to reduce impact to the tiles.\r\n\r\n We apply brand new, fresh grout to the wall tiles. All tile grout that we use is top quality Forever White grout that contains microban which is specifically designed to prevent mould and mildew growth.\r\n\r\n We carefully buff all tiled surfaces to remove excess grout and leave the tiles looking freshly installed.\r\n', '', '', 'Core', 0, 22485, 0, ''),
(0, 303, 'Wall Tile Grout Replacement (Whole Room)', 125, '22485', 'Wall Tile Grout in the Bathroom is Showing Signs of Severe Discolouration & Decay ', 0, 0, 0, 0, 0, 0, 0, 'The wall tile grout in the Bathroom is showing signs of severe discolouration and decay in many areas. Discolouration of wall tile grout is primarily caused by soap residue that lingers on the wall tiles after the shower has been used and gradually discolours over time. \r\n\r\nThis type of severe discolouration is most effectively treated by replacing the wall tile grout around the entire room.\r\n', 0, 0, 'Perform Full Wall Tile Grout Replacement In Bathroom', ' All grout is removed from the wall tiles with professional grade machinery that is fitted with brand new, ultra sharp blades to reduce impact to the tiles.\r\n\r\n We apply brand new, fresh grout to the wall tiles. All tile grout that we use is top quality Forever White grout that contains microban which is specifically designed to prevent mould and mildew growth.\r\n\r\n We carefully buff all tiled surfaces to remove excess grout and leave the tiles looking freshly installed.\r\n', '', '', 'Core', 0, 22485, 0, ''),
(0, 305, 'Wall Tile Grout Chemical Restoration (Whole Room)', 145, '22485', 'Wall Tile Grout in the Bathroom is Showing Signs of Discolouration & Decay', 0, 0, 0, 0, 0, 0, 0, 'The wall tile grout around the bathroom is showing signs of light discolouration and may have decayed in some areas. Discolouration of wall tile grout is primarily caused by soap residue and condensation that lingers on the wall tiles after the shower or bath has been used and gradually discolours over time. \r\n\r\nThis type of light discolouration can be effectively treated with a chemical grout restoration which will achieve excellent results.\r\n', 0, 0, 'Perform Full Chemical Restoration to Wall Tile Grout In The Bathroom', ' All wall tile grout around the Bathroom undergoes a special chemical treatment which loosens any discolouration and dirt that is present on the grout.\r\n\r\n Our team go to work on the grout with brushes, scalpels, scrapers and picks to remove all stubborn residue that may have resisted the initial chemical treatment. \r\n\r\nAny decayed or missing grout is repaired using top quality, ice white grout and the tiles are then washed and buffed to leave them looking pristine.\r\n', '', '', 'Core', 0, 22485, 0, ''),
(0, 307, 'Silicone Replacement Around Hand Basin', 160, '22485', 'Silicone To The Rear of The Hand Basin is Showing Signs of Decay & Black Mould Growth', 0, 0, 0, 0, 0, 0, 0, 'The silicone to the rear of the hand basin is showing signs of decay & black mould growth. The primary cause of this is moisture and soap residue that sits on the silicone and gradually discolours over time.', 0, 0, 'Perform Silicone Replacement To Rear of Hand Basin', ' We cut out the old silicone around the hand basin using low impact, none abrasive techniques and tools to avoid damage to any surfaces. \r\n\r\n A special chemical sealant remover is then applied to all surfaces to remove any microscopic particles of silicone residue which could affect the adhesion of the new silicone.\r\n\r\n We replace the silicone with high quality ForeverWhite silicone which contains microban to prevent future mould growth. All new silicone is applied with a water repelling chamfer which encourages water to drain from the seal and helps to avoid any mould re-growth.\r\n', '', '', 'Core', 0, 22485, 0, ''),
(0, 309, 'Anti-Limescale Treatment to Glass & Shower Accessories ', 175, '22485', 'Shower Glass, Shower Riser Rail & Shower Head are Showing Signs of Lime Scale Build Up', 0, 0, 0, 0, 0, 0, 0, 'Your shower glass, shower head and shower riser rail are showing signs of lime scale build up which can cause a white cloudy residue on the glass. Limescale that is naturally present in the water can cause corrosion to shower door mechanisms, bathroom metalwork and shower nozzles.\r\n', 0, 0, 'Perform Anti-LimeScale Treatment to Shower Glass, Shower Riser Rail & Shower Head', ' The shower head, hose, riser rail & Glass undergo a special Viakal chemical treatment which loosens any mould, limescale and mildew. \r\n\r\n Using rubber scrapers, fine scalpels and blades: we pick, scrape, scrub, and de-scale, every crevice to remove all stubborn traces of mould and lime Scale that have resisted the chemical treatment.\r\n\r\n Finally we sanitise, buff and polish all metal work to really bring back the shine and leave them fully restored.', '', '', 'Core', 0, 22485, 0, ''),
(0, 311, 'Full UPVC Window Restoration', 75, '22485', 'UPVC Window Area is Showing Signs of Discolouration & Decay', 0, 0, 0, 0, 0, 0, 0, 'The area around the UPVC window is showings signs of discolouration & decay. This is another condensation/moisture related problem and can be treated with a full restoration of the window area including, silicone, glass, seals and frame.\r\n', 0, 0, 'Perform Full Restoration of UPVC Window Area', ' Any discoloured silicone is removed from the window area using low impact, none abrasive techniques and tools to avoid damage to any surfaces. \r\n\r\n The window frame is then treated with a restoration solvent to bring it back to ice white condition and the area sanitised using our arsenal of restoration chemicals.  \r\n\r\n Any patches of loose grout are replaced with high quality "forever white" grout and fresh super neat, ice white Silicone is applied to any gaps between wall tiles and window sill.  ', '', '', 'Core', 0, 22485, 0, ''),
(0, 313, 'Part UPVC Window Restoration (Silicone Replacement)', 165, '22485', 'Silicone Around the Window Area is Showing Signs of Decay & Discolouration', 0, 0, 0, 0, 0, 0, 0, 'The silicone around the UPVC window is showings signs of discolouration & decay caused by moisture and condensation. You would love the window area to be restored back to new with the application of super neat, ice white silicone around the window frame to conceal any gaps. ', 0, 0, 'Perform Silicone Replacement Around UPVC Window Area', ' We cut out the old silicone around the window area using low impact, none abrasive techniques and tools to avoid damage to any surfaces. \r\n\r\n A special chemical sealant remover is then applied to all surfaces to remove any microscopic silicone or adhesive residue which could affect the adhesion of the new trims and silicone.\r\n\r\n We replace the silicone with high quality ForeverWhite silicone which contains microban to help prevent future mould growth. All new silicone is applied with a super neat, 45 degree profile that leaves the area looking perfect.\r\n', '', '', 'Core', 0, 22485, 0, '');
INSERT INTO `product` (`tableID`, `Id`, `ProductName`, `ProductPrice`, `Sku`, `ShortDescription`, `Taxable`, `CountryTaxable`, `StateTaxable`, `CityTaxable`, `Weight`, `IsPackage`, `NeedsDigitalDelivery`, `Description`, `HideInStore`, `Status`, `TopHTML`, `BottomHTML`, `ShippingTime`, `LargeImage`, `InventoryNotifiee`, `Shippable`, `_dID`, `OrderOfList`, `ItemType`) VALUES
(0, 315, 'Anti-Mould Treatment to Walls', 140, '22485', 'Bathroom Walls are Showing Signs of Black Mould Growth ', 0, 0, 0, 0, 0, 0, 0, 'The bathroom walls are showing signs of black mould growth. This is caused by condensation and lack of air flow to the bathroom when the bath and shower are in use. \r\n\r\nA anti-mould treatment can remove all traces of black mould and return your bathroom walls to perfect condition. \r\n', 0, 0, 'Perform Full Anti-Mould Treatment To Affected Areas on Bathroom Wall ', ' The Bathroom walls are treated with a special anti-mould/anti-fungal wash which penetrates deep into all types of condensation related mould. \r\n\r\n Using non-abrasive rubber scrapers and neat chemicals, we remove any stubborn mould deposits from all corners and hard to reach areas.\r\n\r\n Any excess chemicals are removed from the walls and a they are given a final diluted treatment which discourages future mould regrowth.\r\n', '', '', 'Core', 0, 22485, 0, ''),
(0, 323, 'Wall Tile Grout Patch Repair', 69, '22485', 'Bathroom Wall Tile Grout Showing Patches of Decay  ', 0, 0, 0, 0, 0, 0, 0, 'The wall tile grout in the bathroom is showing signs of decay in certain areas. Although not needing a full replacement, these areas can be repaired to ensure that no water penetration occurs and that the tiles are visually restored.\r\n\r\n', 0, 0, 'Perform Wall Tile Grout Patch Repair', ' Any decayed or loose grout is removed using professional grade machinery.\r\n\r\n Our Team go to work with brushes, scalpels, scrapers and picks to remove all stubborn residue from the grout lines & tiles. \r\n\r\n Any decayed or missing grout is repaired using top quality, ice white grout and the tiles are sponged down and lightly buffed to leave them looking perfect. \r\n', '', '', 'Core', 0, 22485, 0, ''),
(0, 325, 'Silicone Replacement Exterior of Shower Enclosure', 69, '22485', 'Silicone to Exterior of Shower Enclosure is Showing Signs of Decay & Discolouration', 0, 0, 0, 0, 0, 0, 0, 'The silicone around the exterior of the shower enclosure is showing signs of decay & black mould growth. The primary cause of this is moisture and soap residue that sits on the silicone and gradually discolours over time.', 0, 0, 'Perform Silicone Replacement To Exterior of Shower Enclosure ', ' We cut out the old silicone around the shower enclosure using low impact, none abrasive techniques and tools to avoid damage to any surfaces. \r\n\r\n A special chemical sealant remover is then applied to all surfaces to remove any microscopic particles of silicone residue which could affect the adhesion of the new silicone.\r\n\r\n We replace the silicone with high quality ForeverWhite silicone which contains microban to prevent future mould growth. All new silicone is applied with a water repelling chamfer which encourages water to drain from the seal and helps to avoid any mould re-growth.', '', '', 'Core', 0, 22485, 0, ''),
(0, 327, 'Silicone Replacement Interior of Shower Enclosure', 69, '22485', 'Silicone to Interior of Shower Enclosure is Showing Signs of Decay & Discolouration', 0, 0, 0, 0, 0, 0, 0, 'The silicone around the Interior of the shower enclosure is showing signs of decay & black mould growth. The primary cause of this is moisture and soap residue that sits on the silicone and gradually discolours over time.', 0, 0, 'Perform Silicone Replacement To Interior of Shower Enclosure ', ' We cut out the old silicone around the shower enclosure using low impact, none abrasive techniques and tools to avoid damage to any surfaces. \r\n\r\n A special chemical sealant remover is then applied to all surfaces to remove any microscopic particles of silicone residue which could affect the adhesion of the new silicone.\r\n\r\n We replace the silicone with high quality ForeverWhite silicone which contains microban to prevent future mould growth. All new silicone is applied with a water repelling chamfer which encourages water to drain from the seal and helps to avoid any mould re-growth.\r\n', '', '', 'Core', 0, 22485, 0, ''),
(0, 329, 'UPVC Cladding To Pipe Boxing', 69, '22485', 'Timber Pipe Boxing is Showing Signs of Wear and Discolouration ', 0, 0, 0, 0, 0, 0, 0, 'Timber pipe boxing can soon become discoloured due to moisture and condensation. Especially as it tends to be located in high splash areas such as below the Wash Basin or at floor level.\r\n\r\nAlthough the timber can be repainted, a better solution would be to clad the area in high gloss, white UPVC which would provide an attractive and maintenance free finish.\r\n', 0, 0, 'Clad Timber Pipe Boxing in Maintenance Free, High Gloss White UPVC Paneling ', ' The UPVC panels are cut to size and fixed in place over the existing boxing in using mechanical fixings and industrial strength adhesive. \r\n\r\n Any joints are covered by corner or D-Mould trims which leaves a seamless, maintenance free finish. \r\n\r\n Finally, the cladding is sealed with ice white, neatly profiled silicone to ensure no possibility of water penetration.\r\n', '', '', 'Core', 0, 22485, 0, ''),
(0, 331, 'Bath Stabilisation', 69, '22485', 'Bath Tub Is Showing Signs of Excessive Movement', 0, 0, 0, 0, 0, 0, 0, 'The bath is showing signs of movement when the bath is in use. Excess movement can cause damage to waste & tap connections as well as wall tiles and the silicone seal around the rim of the bath.\r\n\r\nWe have developed the perfect solution which can draw on a number of different solutions to ensure a rock solid finish.\r\n', 0, 0, 'Perform Bath Tub Secure & Stabilisation to Ensure Rock Solid Finish', ' The bath panel is removed and the first of three stability solutions is deployed. This involves using timber supports & wedges to supplement the support already offered by the bath feet.\r\n\r\n The second part of the solution involves fixing additional L brackets (or similar) to the wall and existing vertical timber supports to provide extra stability.  \r\n\r\n The final stage involves using industrial strength adhesives and expanding foams to fill any remaining gaps and ensure that the bath is rock solid. \r\n', '', '', 'Core', 0, 22485, 0, ''),
(0, 333, 'FTB Mortgage', 0, '23233', '', 0, 0, 0, 0, 0, 0, 0, '', 0, 0, '', '', '', '', 'Finance', 0, 23233, 1, ''),
(0, 335, 'Silicone Replacement to Kitchen Sink & Worktops', 0, '22485', 'Silicone to the Rear of the Worktop & Around The Kitchen Sink is Showing Signs of Decay & Discolouration', 0, 0, 0, 0, 0, 0, 0, 'The silicone to the rear of the kitchen worktops & around the sink is showing signs of decay and discolouration. Just like bathrooms, this problem is caused by excess moisture on the silicone but also cooking grease that can cause premature silicone wear and discolouration.\r\n', 0, 0, 'Perform Silicone Replacement to Rear of Kitchen Worktop & Around Sink', ' We cut out the existing silicone and along the rear of the worktop using low impact, none abrasive techniques and tools.\r\n\r\n Using a special chemical sealant remover and a fine scalpel, we remove any remaining silicone residue.\r\n\r\n We replace the silicone with high quality ForeverWhite which contains microban to prevent mould and mildew growth. All new silicone is applied with a water repelling chamfer to ensure a longer lasting seal that is 100% effective.\r\n', '', '', 'Core', 0, 22485, 0, ''),
(0, 337, 'LED Light Swap Outs', 0, '22485', '', 0, 0, 0, 0, 0, 0, 0, '', 0, 0, 'Replace Bathroom Down Lights with Long Lasting, Super Bright, Energy Efficient LED Lighting ', 'LED downlights are the most advanced type of downlight available and outperform conventional lighting in every way. As well as providing energy savings of 80-90%, they can last from 25,000 to 75,000 hours (depending which type you choose). With an average use of 6 hours per day, LED downlights will last between 15 and 30 years. For every 40 halogens you purchase over the same time period, just 1 LED would do! \r\n\r\nSwapping your conventional downlights for LEDs is a very straight forward process that not only saves money but improves the look of any bathroom with a bright, crystal clear light that is available with a choice of subtle colour tints as well as conventional, white. ', '', '', 'Upsell', 0, 22485, 0, ''),
(0, 339, 'Apply Tile Polish', 0, '22485', '', 0, 0, 0, 0, 0, 0, 0, '', 0, 0, 'Apply Tile Polish to All Tiled Surfaces To Really Enhance Their Shine', 'Applying Tile Polish to the wall or floor tiles after the work has been performed will not only make your tiles look fantastic but can also help to prevent future discolouration. The polish acts in exactly the same way as car body polish in that it encourages water to run off the surface leaving them shiny and streak free for longer. ', '', '', 'Upsell', 0, 22485, 0, ''),
(0, 341, 'Perform Deep Clean to Bathroom', 0, '22485', '', 0, 0, 0, 0, 0, 0, 0, '', 0, 0, 'Perform Deep Hygienic Chemical Clean to All Bathroom Surfaces', 'Once your main restoration work is complete we can treat your bathroom to a full surface deep clean which gets into all the hard to reach places such as behind the W/C & Basin, plugholes, overflows, and taps to leave your bathroom sparkling.  ', '', '', 'Upsell', 0, 22485, 0, ''),
(0, 343, 'Grout Removal to Entire Room', 0, '22485', '', 0, 0, 0, 0, 0, 0, 0, '', 0, 0, 'Perform Grout Renewal to Entire Room', 'To give your bathroom the complete ice white, wow factor, you may like to instruct us to extend the grout renewal to cover the entire room. Our client testimonials show time and time again that this is the most effective way to give a new lease of life to the entire room for a fraction of the cost of new tiles.\r\n', '', '', 'Upsell', 0, 22485, 0, ''),
(0, 345, 'Silicone Replacement Around Hand Basin', 0, '22485', '', 0, 0, 0, 0, 0, 0, 0, '', 0, 0, 'Perform Silicone Replacement To Rear of Hand Basin', 'You might like to consider including replacement silicone around the hand basin in your quote which will ensure a neat, ice white, decay free finish to your basin which will match the other restored areas in your bathroom.', '', '', 'Upsell', 0, 22485, 0, ''),
(0, 347, 'Silicone Replacement Around Bath with Trims', 0, '22485', '', 0, 0, 0, 0, 0, 0, 0, '', 0, 0, 'Perform Silicone & Trim Replacement Around The Bath', 'You might like to consider replacement of the trims and silicone around the bath area to really enhance your bathroom restoration and match your ice white shower area.', '', '', 'Upsell', 0, 22485, 0, ''),
(0, 349, 'Supply & Fit W/C Seat', 0, '22485', 'Toilet Seat Requires Replacement', 0, 0, 0, 0, 0, 0, 0, 'You have highlighted your toilet seat as an item that you would like to be replaced.', 0, 0, 'Supply & Fit Replacement Toilet Seat ', ' You choose a suitable style of replacement toilet seat from our wide range of trade suppliers. \r\n\r\n We remove the old seat and perform a light restoration of the area beneath the fixings & hinges which can often be an area where dirt and discolouration builds up over time.\r\n\r\nThe new seat is fitted and tightened to ensure a perfect fit.', '', '', 'Core', 0, 22485, 0, ''),
(0, 351, 'Chemical Restoration to Shower Cubicle Gaskets', 0, '22485', 'Shower Cubicle Gaskets Are Showing Signs of Decay & Discolouration', 0, 0, 0, 0, 0, 0, 0, 'The Shower Cubicle Gaskets (seals) are showing signs of discolouration. This is typically caused by soap residue and moisture build up that occurs when the shower is in use and is then left to dry out.', 0, 0, 'Perform Full Chemical Restoration to Shower Cubicle Gaskets and Trims', ' The shower cubicle gaskets and trims are carefully removed and are immersed is a restoration chemical which breaks down any build up of discolouration.\r\n\r\n For particularly stubborn discoloration deposits, we use soft bristle brushes and light abrasive scrapers to restore the gaskets.\r\n\r\n The gaskets and trims are washed with detergent and water to remove all traces of chemical before they are re-fitted to the shower cubicle.\r\n', '', '', 'Core', 0, 22485, 0, ''),
(0, 353, 'NTB Mortgage', 0, '23233', '', 0, 0, 0, 0, 0, 0, 0, '', 0, 0, '', '', '', '', 'Finance', 0, 23233, 2, ''),
